DROP TABLE IF EXISTS `university`;
CREATE TABLE `university` (
	`id` int(11) NOT NULL AUTO_INCREMENT,
	`name` varchar(255) NOT NULL,
	`address` varchar(255) DEFAULT NULL,
	`logo` varchar(255) DEFAULT NULL,
	`website` varchar(125) DEFAULT NULL,
	`desc` text DEFAULT NULL,
	`url` varchar(255) DEFAULT NULL,
	`longitude` varchar(20) DEFAULT NULL,
	`latitude` varchar(20) DEFAULT NULL,
	`city` varchar(120) DEFAULT NULL,
	`type` varchar(20) DEFAULT NULL,
	`social` varchar(20) DEFAULT NULL,
	PRIMARY KEY (`id`)
) ENGINE=`InnoDB` AUTO_INCREMENT=198 DEFAULT CHARACTER SET utf8 COLLATE utf8_general_ci ROW_FORMAT=COMPACT COMMENT='' CHECKSUM=0 DELAY_KEY_WRITE=0;

