BEGIN;
INSERT INTO `university` VALUES ('1', 'Abant İzzet Baysal Üniversitesi', 'Abant İzzet Baysal Üniversitesi, Gölköy Yerleşkesi, Merkez, Bolu, 14280, Türkiye', 'http://www.ibu.edu.tr/templates/ibu/images/aibu_logo.png', 'http://www.ibu.edu.tr/', '3 Temmuz 1992’de kurulan Abant İzzet Baysal Üniversitesi Bolu’da yer almaktadır. 10 fakülte, 4 enstitü, 6 yüksekokul, 7 meslek yüksekokulu ve 13 araştırma merkezinde yaklaşık 25.000 öğrenci eğitim görmektedir. Tüm bu birimlerinde görev yapan 900 öğretim elemanı ve 550 idari personel bulunmaktadır. Merkezi yerleşkesi Bolu merkez olmak üzere toplam 4 yerleşkesi ( Gerede, Mengen, Mudurnu) bulunmaktadır.', 'abant-izzet-baysal-universitesi', '31.5135089', '40.7138639', 'Bolu', null, '/m/0bsybb'), ('2', 'Abdullah Gül Üniversitesi', 'Abdullah Gül Üniversitesi, Sümer Kampüsü, Kayseri, Türkiye', 'http://www.agu.edu.tr/site/tpl/microsites/agu/images/logo.png', 'http://www.agu.edu.tr', 'Abdullah Gül Üniversitesi, 2010 yılında Kayseri\'de üçüncü nesil üniversitelerin öncüsü olma vizyonu ile ilk vakıf destekli devlet üniversitesi modeli ile kurulmuş bir devlet üniversitesidir. Abdullah Gül Üniversitesi’nin Mimar Sinan Kampüsü ve Sümer Kampüsü olmak üzere iki yerleşkesi bulunmaktadır. Abdullah Gül Üniversitesi, öğrenen odaklı yaklaşımıyla geleceği şekillendirecek bireyler ve küresel sorunlara çözüm arayan bir araştırma üniversitesi olarak kurduğu ortaklıklarla bilgiyi değere dönüştürme misyonuyla eğitim öğretim faaliyetlerine devam etmektedir.', 'abdullah-gul-universitesi', '35.472624', '38.739704', 'Kayseri', null, '/m/0r8pg9z'), ('3', 'Adana Bilim Ve Teknoloji Üniversitesi', 'Adana Bilim ve Teknoloji Üniversitesi, Yeşiloba Yerleşkesi Yeşiloba Mah.Öğretmenler Bulvarı 46278 Sokak No:3 01180 Seyhan / ADANA', 'http://www.adanabtu.edu.tr/tr/images/logo_vektorel_adanabtu-01.png', 'http://www.adanabtu.edu.tr', 'Adana Bilim ve Teknoloji Üniversitesi (ABTÜ), 2011 yılında kurulmuş genç ve dinamik bir devlet üniversitesidir. Bünyesinde 9 Fakülte, 2 Enstitü ve 1 Yüksekokul bulunan ABTÜ ilk öğrencilerini 2013 yılında almıştır. Yüksek donanıma sahip, son teknoloji cihazlarla donatılmış laboratuvar alt yapısına sahip olan ABTÜ, basılı materyallerin yanı sıra 66.563 e-dergi, 215.000 e-kitap, 23.000 e-sesli kitap ve 3 milyon pdf kitap bulunan uluslararası standartlarda elektronik kütüphaneye sahiptir. ABTÜ; öğrenci değişim programlarına sahip, öğrenci projelerini destekleyen; özetle öğrenci ile yakından ilgilenen bir anlayış ile eğitim veren bir üniversitedir.', 'adana-bilim-ve-teknoloji-universitesi', null, null, 'Adana', null, '/m/0114nwy_'), ('4', 'Adnan Menderes Üniversitesi', 'Adnan Menderes Üniversitesi Merkez Kampüsü, Kepez Mevkii Efeler / AYDIN', 'http://www.adu.edu.tr/webfolders/logolar/Adnan-Menderes-Universitesi.jpg', 'http://www.adu.edu.tr', 'Adnan Menderes Üniversitesi, 1992 yılında Aydın\'da kurulmuş olan bir devlet üniversitesidir. 14 fakülte, 3 enstitü, 5 yüksekokul, 18 meslek yüksekokulu, 1 Devlet Konservatuvarı, 24 Uygulama ve Araştırma Merkezi ile eğitim veren üniversitede 1647 Akademik, 1165 İdari personel görev yapmaktadır. Gençliğin bilgiyle buluştuğu üniversite sloganı ile eğitim hayatını sürdüren üniversitede 50,000 kadar öğrenci öğrenim görmektedir', 'adnan-menderes-universitesi', null, null, 'Aydın', null, '/m/03c9hny'), ('5', 'Adıyaman Üniversitesi', 'Altınşehir Mah. 3005. Sokak, 02040 Adıyaman Merkez/Adıyaman, Türkiye', 'http://www.besyoyeteneksinavlari.com/wp-content/uploads/ad%C4%B1yaman-%C3%BCniversitesi-logo.jpg', 'http://www.adiyaman.edu.tr/', 'Adıyaman Üniversitesi 2006 yılında bilgi, ürün ve hizmet üreterek sağlık, tarım ve hizmet sektöründe bulunduğu bölgenin sosyo-ekonomik yapısını geliştiren ve tercih edilen bir üniversite olma vizyonuyla Adıyaman’da kurulmuş bir devlet üniversitesidir. Üniversitenin Adıyaman merkez ilçede ana yerleşkesi, Besni, Gölbaşı ve Kahta ilçelerinde de birer yerleşkesi bulunmaktadır. Üniversite bünyesinde bulunan 13 fakülte, 3 enstitü, 3 yüksekokul, 6 meslek yüksekokulu, 4 araştırma ve uygulama merkezinde 834 akademisyen faaliyet göstermekte, 17873 öğrenci ise bu birimlerde öğrenim görmektedir.', 'adyaman-universitesi', '38.2304333', '37.7449056', 'Adıyaman', null, '/m/0cpnh40'), ('6', 'Afyon Kocatepe Üniversitesi', 'Afyon Kocatepe Üniversitesi Rektörlüğü, Ahmet Necdet Sezer Kampusü, Gazlıgöl Yolu, 03200 AFYONKARAHİSAR ', 'http://aku.edu.tr/wp-content/uploads/2016/02/logo.jpg', 'http://www.aku.edu.tr/', '', 'afyon-kocatepe-universitesi', null, null, 'Afyonkarahisar', null, '/m/0g9w17k'), ('7', 'Ağrı İbrahim Çeçen Üniversitesi', 'Fırat Mh. Erzurum Yolu Üzeri 4. km, 04100 Ağrı, Türkiye', 'http://i.onbesyirmibes.org/image/2013/02/25/338105.jpg', 'http://www.agri.edu.tr', 'Ağrı İbrahim Çeçen Üniversitesi 2007 yılında kurulmuştuştur. Ağrı\'da Erzurum Yolu Üzeri\'nde bulunan yerleşkesinde faaliyet gösteren üniversitenin bünyesinde 6 fakülte, 3 enstitü, 6 yüksekokul ve meslek yüksekokulu ve 5 araştırma ve uygulama merkezi bulunmaktadır. 13.615 öğrencinin öğrenim gördüğü üniversitede 403 akademik personel görev almaktadır.', 'agr-ibrahim-cecen-universitesi', '42.9917789', '39.7197119', 'Ağrı', null, '/m/0g9y3y9'), ('8', 'Ahi Evran Üniversitesi', 'Bağbaşı, Sahir Kurutluoğlu Cad. No:100, 40100 Merkez/Kırşehir, Türkiye', 'http://www.gribilge.com/wp-content/uploads/2014/06/ahi-evran-%C3%BCni-logo.png', 'http://www.ahievran.edu.tr/', 'Ahi Evran Üniversitesi 17 Mart 2006 yılında devlet üniversitesi statüsünde Kırşehir il sınırları içerisinde de kurulmuştur. 7 fakülte, 3 enstitü, 4 yüksekokul, 7 meslek yüksekokulu, 11 araştırma ve uygulama merkezini bünyesinde bulunduran üniversite “Yeni Türkiye\'nin Yenilikçi Üniversitesi” sloganıyla Cacabey, Bağbaşı, Aşık Paşa, Sağlık, Kaman, Mucur, Çiçekdağı, Boztepe ve Akpınar olmak üzere 9 yerleşkede 700\'den fazla akademik personeli ile 17.000 öğrencisine eğitim öğretim imkanı sağlamaktadır.', 'ahi-evran-universitesi', '34.15555', '39.137367', 'Kırşehir', null, '/m/0cpbf72'), ('9', 'Akdeniz Üniversitesi', 'Akdeniz Üniversitesi Dumlupınar Bulvarı 07058 Kampus Antalya / TÜRKİYE', 'http://www.vektorelcizim.net/uploads/file/images/akdeniz_universitesi_yeni_logo.png', 'http://www.akdeniz.edu.tr', 'Akdeniz Üniversitesi 1982 yılında devlet üniversitesi statüsünde Antalya\'da kurulmuştur. 16 fakülte, 7 enstitü, 5 yüksekokul, 11 meslek yüksekokulu ve 43 araştırma ve uygulama merkezinde “Işık Saçan, Toplumu Aydınlatan, Bir Dünya Üniversitesi” sloganıyla 56916 öğrencisine 2549 akademik personeli ile eğitim öğretim vermektedir.', 'akdeniz-universitesi', '30.6399441', '36.8902799', 'Antalya', null, '/m/027j5lx'), ('10', 'Aksaray Üniversitesi', 'Adana Yolu Üzeri E-90 Karayolu 7. Km Merkez Kampüs 68100 Aksaray / Türkiye', 'http://www.aksaray.edu.tr/files/logomuz_ve_oykusu/logo_renkli.jpg', 'http://www.aksaray.edu.tr/', 'Aksaray Üniversitesi 17 Mart 2006\'da Aksaray il sınırları içerisinde kurulmuştur. Merkez, Şereflikoçhisar, Ortaköy ve Güzelyurt\'ta olmak üzere 6 yerleşkesi bulunmaktadır. Üniversite, bünyesinde 9 fakülte, 4 yüksekokul, 7 meslek yüksekokulu, fen ve sosyal bilimler enstitüleri ve 11 araştırma merkezi ile faaliyet göstermektedir. Aksaray Üniversitesi 18.048 öğrencisine 721 akademik personeli ile evrensel düşünen yereli gözeten felsefesini savunarak eğitim öğretim imkanı sağlamaktadır.', 'aksaray-universitesi', '33.9809689', '38.3258008', 'Aksaray', null, '/m/0g9zg_0'), ('11', 'Alanya Alaaddin Keykubat Üniversitesi', 'Merkez Mahallesi, Sigorta Caddesi, 07425 Kestel/Alanya/Antalya, Türkiye', 'http://www.memurpostasi.com/d/news/10802.jpg', 'http://www.alanyaaku.edu.tr', '', 'alanya-alaaddin-keykubat-universitesi', null, null, 'Antalya', null, null), ('12', 'Amasya Üniversitesi', 'Akbilek Mah. Muhsin Yazıcıoğlu Cad. No:7 PK: 05100 Merkez/AMASYA', 'http://sporakademisi.com/wp-content/uploads/2016/05/amasya-universitesi.jpg', 'http://www.amasya.edu.tr', 'Amasya Üniversitesi 01.03.2006 tarihinde Amasya\'da kurulmuştur. Üniversite bünyesinde 6 fakülte, 1 yüksekokul, 8 meslek yüksekokulu, 2 enstitüsünde 12816 öğrencisine 450 akademik personeli ile birlikte daha iyiye sloganıyla eğitim öğretim hizmeti vermektedir.', 'amasya-universitesi', '35.804925', '40.6537739', 'Amasya', null, '/m/0cnv4d8'), ('13', 'Anadolu Üniversitesi', 'Yunusemre Kampusu, 26470 Eskişehir, Türkiye', 'http://sporakademisi.com/wp-content/uploads/2016/05/anadolu-universitesi-logo.jpg', 'http://www.anadolu.edu.tr/', '', 'anadolu-universitesi', '30.5019538', '39.7905844', 'Eskişehir', null, 'm/064f68'), ('14', 'Ankara Üniversitesi', 'Ankara Üniversitesi Rektörlüğü, Dögol Caddesi 06100, Tandoğan / Ankara / Türkiye', 'http://basimevi.ankara.edu.tr/files/2012/10/Ankara-%C3%9Cniversitesi.jpg', 'http://www.ankara.edu.tr', 'Ankara Üniversitesi, 1946 yılında  Atatürk ilke inkılâplarının dayanaklarını oluşturmak, bu ilke ve inkılâpları yurt geneline yaymak, kökleştirmek ve çağdaşlığın, bilimin ve aydınlığın ifadesi olan bu değerlerin yılmaz savunuculuğunu yapmak üzere, temeli bizzat yüce Atatürk tarafından atılan Ankara\'da kurulmuş bir devlet üniversitesidir. Ankara Üniversitesi’ne bağlı 5 yerleşkede,17 fakülte, 1 yüksekokul, 10 meslek yüksekokulu ve 1 Devlet Konservatuvarı, 13 enstitü ve 42 araştırma, uygulama ve eğitim merkezi bulunmakta ve bu birimlerde 68476 öğrenci öğrenim görmektedir. Nitelikli araştırmalar yapan, bilgi ve yeteneklerini insanlık ve ülke yararına kullanan ve evrensel düzeyde fark yaratarak geleceğe yön veren yenilikçi üniversite olma vizyonu ile hareket eden Ankara Üniversitesi bünyesinde 4293 akademik personel ile 5687 idari personel görev yapmaktadır.   ', 'ankara-universitesi', '32.831538', '39.9351287', 'Ankara', null, '/m/0679jh'), ('15', 'Ardahan Üniversitesi', 'Ardahan Üniversitesi Yenisey Kampüsü, Çamlıçatak Mevkii, Ardahan 75000', 'http://ubys.ardahan.edu.tr/images/uniLogo.png', 'http://www.ardahan.edu.tr', 'Ardahan Üniversitesi, 22 Mayıs 2008 tarihinde Ardahan\'da kurulmuştur. Yenisey yerleşkesinde faaliyet gösteren ve Kafkas Üniversiteler Birliği\'ne üye olan 3889 öğrencinin öğrenim gördüğü Ardahan Üniversitesi\'nin bünyesinde 4 fakülte, 5 meslek yüksekokulu, 2 yüksekokul, 2 enstitü ve 5 araştırma merkezi bulunmaktadır. Işığa karışın sloganı ile eğitim öğretim hayatını sürdüren Ardahan Üniversitesi\'nde 287 akademik personel akademik faaliyetlerini sürdürmektedir.', 'ardahan-universitesi', null, null, 'Ardahan', null, '/m/0r8l58f'), ('16', 'Artvin Çoruh Üniversitesi', 'Artvin Çoruh Üniversitesi Rektörlüğü 08100 Seyitler, Merkez, Artvin, Türkiye', 'http://vektorlogo.com/wp-content/uploads/2016/04/artvin-%C3%A7oruh-%C3%BCniversitesi-vektorel-cizim-logo.jpg', 'http://www.artvin.edu.tr', 'Artvin Çoruh Üniversitesi 17 Mayıs 2007 tarihinde birbirine 3 km uzaklıktaki iki ana yerleşke olan Şehir ve Seyitler Yerleşkeleri ile Hopa ilçesinde kurulan Hopa Yerleşkesi üzerinde devlet üniversitesi statüsünde göğe komşu topraklarda bir üniversite sloganıyla kurulmuştur. Artvin Çoruh Üniversitesi 7 fakülte, 6 meslek yüksekokulu, 2 enstitü, 1 yüksekokul ve 471 akademik personeli ile 7031 öğrenciye eğitim ve öğretim imkanı sağlamaktadır.', 'artvin-coruh-universitesi', null, null, 'Artvin', null, '/m/0r8m4fg'), ('17', 'Atatürk Üniversitesi', 'Atatürk Üniversitesi Kampüsü, 25030, Türkiye', 'http://halittutuncu.com/wp-content/uploads/2015/07/atatu%CC%88rk-uni-logo.jpg', 'http://www.atauni.edu.tr', 'Atatürk Üniversitesi 7 Haziran 1957 tarihinde “verdiği eğitimin, ürettiği bilgive teknolojinin, sunduğu hizmetlerin dünyada öncelikli olarak talep edildiği bir üniversite olma vizyonuyla Erzurum\'da kurulmuş bir devlet üniversitesidir. Bölgesel ve ulusal düzeyde sürdürülebilir kalkınmaya katkıda bulunabilen, analiz ve sentez yapabilen, öğrendiğini uygulayabilen, sonuçlarını değerlendirebilen; iletişim, takım çalışması ve liderlik becerilerine sahip mezunları ve sorun çözebilen, uluslar arası düzeyde bilgi ve teknoloji üreten, öğretme ve öğrenme coşkusuna sahip çalışanları ile ürettiği bilgi ve hizmeti toplumun yararına sunmayı misyon edinmiş 155.561 öğrenim gördüğü üniversitenin, merkez kampüsü ve ilçelerindeki  yüksekokullarında bulunan 22 fakülte, 7 enstitü, 2 yüksekokul, 12 meslek yüksekokulu ve 20 araştırma merkezinde 2621 akademik personel akademik çalışmalarını sürdürmektedir.', 'ataturk-universitesi', '41.2556872', '39.9047608', 'Erzurum', null, '/m/03wg27h'), ('18', 'Azerbaycan Devlet İktisat Üniversitesi', '', 'http://www.azerbaycanuniversiteleri.com/images/universiteler/azerbaycan-devlet-iktisat-universitesi-01.jpg', 'http://www.tdavaz.org/', '', 'azerbaycan-devlet-iktisat-universitesi', null, null, 'Bakü (Azerbaycan)', null, null), ('19', 'Azerbaycan Devlet Medeniyet Ve İncesanat Üniversitesi', '', null, 'http://www.admiu.edu.az/', '', 'azerbaycan-devlet-medeniyet-ve-ince-sanat-universitesi', null, null, 'Bakü (Azerbaycan)', null, null), ('20', 'Azerbaycan Devlet Pedagoji Üniversitesi', '', null, 'http://adpu.edu.az/', '', 'azerbaycan-devlet-pedagoji-universitesi', null, null, 'Bakü (Azerbaycan)', null, null), ('21', 'Azerbaycan Diller Üniversitesi', '', null, 'http://www.adu.edu.az/', '', 'azerbaycan-diller-universitesi', null, null, 'Bakü (Azerbaycan)', null, '/m/0cm0q1'), ('22', 'Azerbaycan Mimarlık Ve İnşaat Üniversitesi', '', null, 'http://www.azmiu.edu.az/', '', 'azerbaycan-mimarlk-ve-insaat-universitesi', null, null, 'Bakü (Azerbaycan)', null, '/m/02x3312'), ('23', 'Azerbaycan Tıp Üniversitesi', '', null, 'http://amu.edu.az/', '', 'azerbaycan-tp-universitesi', null, null, 'Bakü (Azerbaycan)', null, '/m/0cnc7d'), ('24', 'Bakü Devlet Üniversitesi', '', null, 'http://www.bsu.edu.az/', '', 'baku-devlet-universitesi', null, null, 'Bakü (Azerbaycan)', null, '/m/0cljnv'), ('25', 'Bakü Slavyan Üniversitesi', '', null, 'http://bsu-edu.org/', '', 'baku-slavyan-universitesi', null, null, 'Bakü (Azerbaycan)', null, '/m/0cmqnv'), ('26', 'Balıkesir Üniversitesi', 'Balıkesir Üniversitesi Rektörlüğü Çağış Yerleşkesi (Bigadiç yolu üzeri 17. km) 10145, BALIKESİR', 'http://ieee.balikesir.edu.tr/images/baulogo.png', 'http://www.balikesir.edu.tr/', 'Balıkesir Üniversitesi, 11 Temmuz 1992 tarihinde Balıkesir il sınırları içerisinde kurulmuş bir devlet üniversitesidir. Üniversite Bigadiç yolu üzeride bulunan Çağış yerleşkesi ve ilçelere dağılmış olan yüksekokullarında faaliyet göstermektedir. Üniversite bünyesinde 11 fakülte, 5 yüksekokul, 16 meslek yüksek okulu, 5 enstitü ve 20 araştırma merkezi bulunmaktadır. “Eğitimde, Bilimde, Sanatta Çağdaş” sloganı ışığında eğitim ve öğretim veren üniversitede 1081 akademik personel görev almakta, 38.892 öğrenci ise öğrenim görmektedir.', 'balkesir-universitesi', '28.0031951', '39.5397069', 'Balıkesir', null, '/m/07s3pj2'), ('27', 'Bandırma Onyedi Eylül Üniversitesi', 'Yeni Mahalle Şehit Astsubay Mustafa Soner Varlık Caddesi, No:77 Bandırma/BALIKESİR', 'http://bandirma.edu.tr/wp-content/themes/exclusive/images/default.png', 'http://www.bandirma.edu.tr', 'Bandırma Onyedi Eylül Üniversitesi, Balıkesir\'in Bandırma ilçesinde 2015 yılında devlet üniversitesi statüsünde kurulmuştur. Gönen yolu üzerinde bulunan üniversite, merkez kampüsü ve çevre ilçelerdeki binalarındaki 5 fakültesi, 4 enstitüsü, 1 yüksekokulu ve 4 meslek yüksekokulunda eğitim öğretim faaliyetlerini sürdürmektedir', 'bandrma-onyedi-eylul-universitesi', null, null, 'Balıkesir', null, null), ('28', 'Bartın Üniversitesi', 'Bartın Üniversitesi Rektörlüğü Merkez/BARTIN,74100', 'http://www.bartin.edu.tr/Files/itktuza5szyabijho1xbbn53h20111110215549itktuza5szyabijho1xbbn53h20111110215549.png', 'http://www.bartin.edu.tr/', '', 'bartn-universitesi', null, null, 'Bartın', null, '/m/0r8lp6g'), ('29', 'Batman Üniversitesi', 'Batman Üniversitesi, Merkez Kampüsü, 72060 Batman, Türkiye', 'http://www.freelogovectors.net/wp-content/uploads/2013/04/batman_universitesi_logo.jpg', 'http://www.batman.edu.tr', 'Batman Üniversitesi, 28 Mayıs 2007 tarihinde devlet üniversitesi statüsünde Batman\'da kurulmuştur. Batman Üniversitesi\'nin Merkez Kampüsü, Batı Raman Kampüsü, Kozluk Kampüsü ve Hasankeyf Kampüsü olmak üzere toplam 4 kampüsü bulunmaktadır. 7 fakülte, 3 ensititü, 4 yüksekokul, 4 meslek yüksekokulu, 8 araştırma merkezi bulunan üniversitede 400 akademisyen görev almakta ve 9600 öğrenci öğrenim görmektedir.', 'batman-universitesi', null, null, 'Batman', null, '/m/0cp4mmv'), ('30', 'Bayburt Üniversitesi', 'Bayburt Üniversitesi Rektörlüğü, Dede Korkut Kampüsü 69000 / Bayburt', 'http://www.atauniv.com/wp-content/uploads/2011/06/bayburt-universitesi-logosu-600x521.jpg', 'http://www.bayburt.edu.tr', '', 'bayburt-universitesi', null, null, 'Bayburt', null, '/m/05p7g8z'), ('31', 'Bilecik Şeyh Edebali Üniversitesi', 'Bilecik Şeyh Edebali Üniversitesi Rektörlüğü 11210 Gülümbe/BİLECİK', 'http://www.xsorgula.com/files/news/thumb/news-3bbf129374b65eaec997.jpg', 'http://www.bilecik.edu.tr/', 'Bilecik Şeyh Edebali Üniversitesi 29 Mayıs 2007 tarihinde, eğitim-öğretim ve bilimsel araştırmalar konusunda tercih edilen, kurumsal kimliği ve kültürü gelişmiş bir üniversite olarak bilim dünyasına katkı sağlama vizyonuyla Bilecik il sınırları içerisinde devlet üniversitesi olarak kurulmuştur. Merkez kampüsü Gülümbe\'de bulunan üniversite meslek yüksekokulları ile Bilecik\'in ilçelerine yayılım göstermiştir. İlim ve fen için kayıt ve şart yoktur sloganı ışığında eğitim faaliyetlerini sürdüren üniversitenin bünyesinde 5 fakülte, 2 enstitü, 2 yüksekokul ve 7 meslek yüksekokulu bulunmaktadır. Bu eğitim birimlerinde 13863 öğrenci öğrenim görmekte, 455 akademik personel de bu birimlerde çalışmalarını sürdürmektedir.', 'bilecik-seyh-edebali-universitesi', null, null, 'Bilecik', null, '/m/0r8m1bg'), ('32', 'Bingöl Üniversitesi', 'Selahaddin-i Eyyubi Mah. Aydınlık Cad. No: 1 Posta Kodu: 12000, Bingöl/TÜRKİYE', 'http://www.bingol.edu.tr/documents/file/bu_BilgolUniverstyLogo/5-300-b8a17557-c808-48cf-9ffe-e0c8098ee96a.jpg', 'http://www.bingol.edu.tr', 'Bingöl Üniversitesi 29 Mayıs 2007 tarihinde Bingöl il sınırları içerisinde bilimsel faaliyetleriyle birlikte, içinde bulunduğu toplumun gerçeklerinin farkında ve değerleriyle barışık olarak toplumla güçlü ilişkiler kuran, bölgesel kaynakları en ideal biçimde kullanıp sürdürülebilir kalkınmayla birlikte insan odaklı rekabet gücünü artıran, yükseköğretimde çağın gereklerine yönelik adımlar atan ve bilimsel değerleri kendine rehber edinen ve özümseyen bir üniversite olma vizyonuyla devlet üniversitesi olarak kurulmuştur.Tek bir ana yerleşkede hizmet veren üniversitenin bünyesinde 7 Fakülte, 3 Yüksekokul, 5 Meslek Yüksekokulu ve 4 Enstitü birimi bulunmaktadır. Bu birimlerde 11065 öğrenci öğrenim görmekte, 484 akademik personel de çalışmalarını yürütmektedir.', 'bingol-universitesi', null, null, 'Bingöl', null, '/m/0r8lt74'), ('33', 'Bitlis Eren Üniversitesi', 'Rahva Yerleşkesi Beş Minare Mah. Ahmet Eren Bulvarı 13000 Merkez/Bitlis', 'http://bebap.beu.edu.tr/themes/t-bitlis/images/e-icon.png', 'http://www.beu.edu.tr/Default.aspx', '', 'bitlis-eren-universitesi', null, null, 'Bitlis', null, '/m/0r8qj32'), ('34', 'Boğaziçi Üniversitesi', 'Boğaziçi Üniversitesi 34342 Bebek/İstanbul Türkiye', 'http://www.logomuz.com/dosyalar/resim/bogazici-universitesi-1282219375.jpg', 'http://www.boun.edu.tr', 'Boğaziçi Üniversitesi, Amerika Birleşik Devletleri sınırları dışında kurulan ilk yükseköğretim kurumu olan Robert Kolej adıyla 1863 yılında kurulmuştur. 1971 yılında ise Boğaziçi Üniversitesi’ne dönüşerek  Kolej’in eğitim geleneğini ve öğretim dili olarak da İngilizceyi koruyarak seçkin bir Türk kamu araştırma üniversitesi haline gelmiştir. O zamandan beri hem lisans ve hem de lisansüstü programlarını genişleten ve bünyesine yeni kampüsler ekleyen Boğaziçi Üniversitesi, şu anda temel ve sosyal bilimler, mühendislik, eğitim ve uygulamalı bilim dallarında üstün lisans ve lisansüstü programları ile Türkiye\'nin önde gelen üniversitelerinden biridir. Dünya standartlarında sağladığı öğretim kalitesiyle, birinci sınıf laboratuvarları ve araştırma merkezleri ve nefes kesen kampüsüyle Türkiye\'nin ve bölge ülkeleri öğrencilerinin en çok tercih ettiği üniversite olmuştur. 3800’den fazlası lisansüstü öğrenci olmak üzere toplam öğrenci sayısı 15.000’e ulaşmıştır. Boğaziçi Üniversitesi,  32 ayrı akademik bölümü, altı lisansüstü enstitüsü ve 19 araştırma merkezi ile geniş bir yelpazede tüm disiplinleri kapsayan, yüksek etkili araştırmalar sürdürmektedir. Üniversitenin bu araştırma faaliyetleri için ulusal ve uluslararası araştırma fonu kuruluşlarının yanı sıra sanayiden de araştırma fonu desteği sağlanmaktadır. Dünya çapında önde gelen akademik kurumlarla yaptığı ortaklıklar neticesinde ise üniversitenin araştırmacı kimliği önemli oranda güçlenmiştir.', 'bogazici-universitesi', '29.051893', '41.08337', 'İstanbul', null, '/m/02vxmh'), ('35', 'Bozok Üniversitesi', 'Şeyh Osman Mh., Bozok Üniversitesi Rektörlüğü, Yozgat, Türkiye', 'http://www.bozok.edu.tr/images/500px-bozok_universitesi.jpg', 'http://www.bozok.edu.tr/', 'Bozok Üniversitesi, 1 Mart 2006 tarihinde Yozgat\'ta kurulmuş devlet üniversitesidir. Merkez kampüsünün Akdağ Kampüsü olduğu Üniversite\'de rektörlük gibi idari binalar Yozgat şehir merkezinde, meslek yüksekokulları ise çevre ilçelerde bulunmaktadır. Üniversite bünyesinde bulunan 9 fakülte, 4 yüksekokul, 6 meslek yüksekokulu 3 enstitü, 7 uygulama ve araştırma Merkezi\'nde toplam 12.095 öğrencisine 706 akademik personeli ile eğitim vermektedir.', 'bozok-universitesi', null, null, 'Yozgat', null, '/m/0134gmwz'), ('36', 'Bülent Ecevit Üniversitesi', 'Bülent Ecevit Üniversitesi Rektörlüğü PK:67100 İncivez/ZONGULDAK', 'http://i.internethaber.com/files/2016/1/24/1559847/1559847.jpg?v=1453628312KdQuo5KUOX', 'http://www.beun.edu.tr', 'Bülent Ecevit Üniversitesi 1992 yılında Zonguldak Karaelmas Üniversitesi adıyla Zonguldak\'ta kurulmuş bir devlet üniversitesidir. Üniversitenin İncirharmanı Yerleşkesi, Çaycuma M.Y.O Yerleşkesi ve çevre ilçelerinde bulunan meslek yüksekokulu binaları mevcuttur. Bünyesinde bulunan 11 fakülte, 5 yüksekokul, 7 meslek yüksekokulu 3 enstitü, 1 devlet konservatuvarı ve 29 Uygulama ve Araştırma Merkezi\'nde 26.503 öğrencisine 1122 akademik ve 1238 idari personeli ile ulusal ve uluslararası düzeyde eğitim-öğretim hizmeti verme, bilimsel araştırmalar yapma ve bilimi, teknolojiyi, sanatı ve kültürel değerleri girişimci bir üniversite olarak insanlığın hizmetine sunma misyonunu benimseyerek eğitim vermektedir.', 'bulent-ecevit-universitesi', null, null, 'Zonguldak', null, '/m/0cp4ml0'), ('37', 'Bursa Teknik Üniversitesi', 'Eğitim Cd., 16330 Yıldırım, Türkiye', 'http://depo.btu.edu.tr/dosyalar/btu/Dosyalar/TR%20LOGO(1).jpg', 'http://www.btu.edu.tr', 'Bursa Teknik Üniversitesi 21 Temmuz 2010 tarihinde teknik üniversite olarak devlet üniversitesi statüsünde Ulusal ve uluslararası alanda eğitim, öğretim ve araştırma kalitesi ile tercih edilen yenilikçi ve girişimci bir üniversite olma vizyonuyla Bursa\'da kurulmuştur. Merkez yerleşkesi Yıldırım olan üniversitenin Merinos ve Osmangazi\'de de yerleşkeleri bulunmaktadır. Bünyesinde 6 Fakülte, 2 Enstitü ve 1 Yüksek okul ve 2 araştırma ve uygulama merkezi bulunan üniversitede 152 akademik personel görev almaktadır. Bursa Teknik Üniversitesi\'nde 712 öğrenci öğrenim görmektedir.', 'bursa-teknik-universitesi', null, null, 'Bursa', null, '/m/0h7lcc0'), ('38', 'Çanakkale Onsekiz Mart Üniversitesi', 'Çanakkale Onsekiz Mart Üniversitesi - ÇANAKKALE / TÜRKİYE', 'http://bidb.comu.edu.tr/comu_logo_3.png', 'http://www.comu.edu.tr', 'Çanakkale 18 Mart Üniversitesi 3 Temmuz 1992 Tarihinde Çanakkale’de Devlet Üniversitesi Statüsünde sürdürülebilir performansı ve gelişmeyi referans yapan üniversite olma Misyonu ve uluslararası akademik topluluklar ile sürdürülebilir etkileşim sağlayan dünya üniversitesi olma vizyonuyla kurulmuştur. Ana yerleşkesi Terzioğlu Yerleşkesi olan üniversitenin Anafartalar, Dardanos, Sarıcaeli ve Ağaköy yerleşkeleri bulunmaktadır. Bünyesinde bulunan 12 Fakülte, 12 Meslek Yüksekokulu, 8 Yüksekokul, 4 Enstitü ve 22 araştırma ve uygulama merkezinde 1600 akademik personel görev almaktadır. 42.436 öğrenci ise bu birimlerde öğrenim görmektedir.', 'canakkale-onsekiz-mart-universitesi', '26.4107054', '40.1065248', 'Çanakkale', null, '/m/0bzd0b'), ('39', 'Çankırı Karatekin Üniversitesi', 'Uluyazı Kampüsü Rektörlük Binası, MERKEZ / ÇANKIRI', 'http://karatekin.edu.tr/dosyalar/2010/aralik/image/odul.jpg', 'http://www.karatekin.edu.tr/', 'Çankırı Karatekin Üniversitesi 28 Mayıs 2007 tarihinde yenilikçi, uluslararası düzeyde eğitim-öğretim ve araştırmada öncü; öğrenciler, araştırmacılar ve çalışanlar tarafından tercih edilen bir kurum olma vizyonunu benimseyerek “Güler yüzlü üniversite” sloganı ile Çankırı\'da kurulmuştur. Uluyazı Kampüsü\'nde faaliyetlerini yürüten üniversitenin bünyesinde 6 Fakülte, 4 Meslek Yüksekokulu, 2 Yüksekokul, 4 Enstitü ve 7 araştırma ve uygulama merkezi bulunmaktadır. Bu birimlerde 611 öğretim elemanı görev almakta, 10573 öğrenci öğrenim görmektedir.', 'cankr-karatekin-universitesi', '33.617002', '40.598328', 'Çankırı', null, '/m/0r8pz72'), ('40', 'Celâl Bayar Üniversitesi', 'Muradiye Kampüsü 45140 - Yunusemre - MANİSA', 'http://seeklogo.com/images/C/celal-bayar-universitesi-logo-C06A2C4CE1-seeklogo.com.gif', 'http://www.cbu.edu.tr', 'Celal Bayar Üniversitesi 11 Temmuz 1992 tarihinde Manisa\'da devlet üniversitesi statüsünde bilimde, eğitimde ve hizmette uluslararası saygınlığı olan bir üniversite haline gelme vizyonu ile kurulmuştur. 10 fakülte, 5 yüksekokul, 15 meslek yüksekokulu, 3 enstitüsü, 22 araştırma uygulama merkezi bulunan üniversitede 1.581 akademisyen görev almakta ve 48.607 öğrenci öğrenim görmektedir. Celal Bayar Üniversitesi, ulusal kimliğini küresel değerlerle bağdaştırabilen, kendisini sürekli geliştirebilen, teknolojiye hakim, girişimci, çevreye ve topluma saygılı, eleştirel düşünme becerisine sahip, insan hakları, demokrasi, etik ve kültürel değerler konusunda duyarlı mezunlar yetiştirmek; bilime ve teknolojiye uluslararası düzeyde katkıda bulunacak araştırmalar yapmak, bu araştırmaları yapacak kadroları yetiştirmek ve gerekli altyapıyı oluşturmak; araştırma, eğitim ve hizmet alanlarındaki üretimini toplum yararına sunma amacıyla eğitim öğretim hayatını sürdürmeye devam etmektedir.', 'celal-bayar-universitesi', null, null, 'Manisa', null, '/m/047dj_k'), ('41', 'Çukurova Üniversitesi', 'Çukurova Üniversitesi Rektörlüğü 01330 Balcalı, Sarıçam / ADANA', 'http://www.cu.edu.tr/upload/cukurova_logo.png', 'http://www.cu.edu.tr/', 'Çukurova Üniversitesi Ankara ve Atatürk Üniversitelerine bağlı olarak 30.11.1973 tarihinde Adana’da kurulmuştur. Seyhan gölü kıyısındaki Balcalı Kampüsü’nde eğitim-öğretim veren üniversite bünyesinde 17 fakülte, 4 yüksekokul, 12 meslek yüksekokulu, 1 devlet konservatuvarı, 3 enstitü ve 32 araştırma ve uygulama merkezi bulunmaktadır. Bu birimlerde 2186 akademik personel, 49.711 öğrencinin eğitim ve öğretiminde görev almaktadır.', 'cukurova-universitesi', '35.3601254', '37.0551405', 'Adana', null, '/m/0448dj'), ('42', 'Cumhuriyet Üniversitesi', 'Cumhuriyet Üniversitesi 58140 KAMPÜS/SİVAS', 'http://logovector.org/wp-content/uploads/logos/png/s/sivas_cumhuriyet_universitesi_logo.png', 'http://www.cumhuriyet.edu.tr/', 'Cumhuriyet Üniversitesi 9 Şubat 1974 tarihinde ulusal ve uluslar arası düzeyde eğitim-öğretim, araştırma ve mesleki alanda tanınırlık ve saygınlık, örgütsel bağları güçlü, kurumsal kültürü ve kimliği gelişmiş üretken, toplumsal ve ek ihtiyaçlara cevap veren bölgesinde lider üniversite olma vizyonuyla Sivas’ta devlet üniversitesi statüsünde kurulmuştur. Sivas merkezde bulunan Merkez yerleşkesinin yanı sıra çevre ilçelerde meslek yüksekokulları konumlanan Cumhuriyet Üniversitesi’nin bünyesinde, 16 Fakülte, 4 Enstitü, 1 devlet konservatuvarı, 5 Yüksekokul, 14 Meslek Yüksekokulu bulunmaktadır. Bu birimlerde 1789 akademik personel ve 1602 idari personel görev almaktadır. Cumhuriyet Üniversitesi bünyesinde öğrenim gören öğrenci sayısı ise 53.000\'dir.', 'cumhuriyet-universitesi', '37.0110269', '39.7101036', 'Sivas', null, '/m/04ld3m7'), ('43', 'Deniz Harp Okulu', 'Deniz Harp Okulu Komutanlığı 34942 Tuzla / İSTANBUL', 'http://www.e-marineeducation.com/tr/wp-content/uploads/Deniz-Harp-Okulu-Logosu.png', 'https://www.dho.edu.tr/', '', 'deniz-harp-okulu', null, null, 'İstanbul', null, '/m/02pvl2v'), ('44', 'Dicle Üniversitesi', 'Dicle Üniversitesi Rektörlüğü, 21280-Diyarbakır.', 'http://www.dicle.edu.tr/Contents/c1dcaadc-b976-499a-84e7-d71871668193.gif', 'http://www.dicle.edu.tr', 'Dicle Üniversitesi 1974 yılında bölgesine, ülkesine ve evrensel bilime katkıda bulunacak bir araştırma üniversitesi olma vizyonu ile Diyarbakır il sınırları içerisinde devlet üniversitesi statüsünde kurulmuştur. Dicle Üniversitesi bünyesinde 14 fakülte, 4 yüksekokul, 11 meslek yüksekokulu ve 4 enstitüsü, teknokent, 24 Araştırma ve Uygulama Merkezi bulunmaktadır. Bu birimlerde faaliyetlerini yürüten 3600 civarında kadrolu akademik ve idari elemanı ile Dicle Üniversitesi, yaklaşık olarak 30.000 öğrenciye evrensel değerleri temel alarak yaptığı eğitim, öğretim ve araştırma faaliyetleriyle her alanda yetkin, yaratıcı, girişimci, ahlaki değer ve toplumsal sorumluluk sahibi üstün nitelikli bireyler yetiştirme, topluma ve çevreye duyarlı yüksek nitelikli bilimsel ve kültürel çalışmalar yapma ve insanlığın yararına sunma amacıyla eğitim vermektedir.', 'dicle-universitesi', null, null, 'Diyarbakır', null, '/m/0ds0828'), ('45', 'Doğu Akdeniz Üniversitesi', '', 'http://ww1.emu.edu.tr/emu_v1/media/assets/files/logo/emu-dau-logo.jpg', 'http://ww1.emu.edu.tr/tr/', '', 'dogu-akdeniz-universitesi', null, null, 'Gazimağusa (KKTC)', null, '/m/03qkyx'), ('46', 'Dokuz Eylül Üniversitesi', 'DOKUZ EYLÜL ÜNİVERSİTESİ REKTÖRLÜĞÜ Cumhuriyet Bulvarı No: 144 35210 Alsancak / İZMİR', 'http://logovector.org/wp-content/uploads/logos/png/d/dokuz_eylul_universitesi_logo.png', 'http://www.deu.edu.tr', 'Dokuz Eylül Üniversitesi 20 Temmuz 1982`de İzmir il sınırları içerisinde kurulmuştur. Rektörlük yerleşkesinin Alsancak’ta bulunduğu üniversitenin İnciraltı, Tınaztepe, Dokuzçeşmeler yerleşkesi ile toplamda 4 yerleşkesi bulunmaktadır. Üniversite bünyesinde bulunan 14 Fakülte, 4 Yüksekokul, 7 Meslek Yüksekokulu, 1 Konservatuvar, 10 Enstitü ve 54 Uygulama ve Araştırma Merkezi\'nde 3.324 akademik personel çalışmalarını yürütmekte, 62.663 öğrenci de öğrenim görmektedir.', 'dokuz-eylul-universitesi', '27.2097254', '38.3685103', 'İzmir', null, '/m/063hy9'), ('47', 'Dumlupınar Üniversitesi', 'Evliya Çelebi Yerleşkesi Tavşanlı Yolu 10.km Kütahya / Türkiye', 'http://www.dumlupinar.edu.tr/app/views/panel/ckfinder/userfiles/1/images/logolar/dpu_logo_1.png', 'http://dumlupinar.edu.tr', 'Dumlupınar Üniversitesi, 03.07.1992 tarihinde Kütahya\'da mesleki bilgi ve tecrübelerini insanlığın huzur ve mutluluğu için kullanacak, vatanı ve milleti için fedakârca çalışacak, yüksek mesleki donanıma sahip nesiller yetiştiren eğitim öğretim kurumu olma ve bilim, sanat, kültür, spor ve sağlık alanlarında kendini sürekli geliştiren, diğer üniversitelerle rekabet gücü yüksek, nitelikli, yenilikçi eğitim öğretim kurumu olma vizyonuyla kurulmuştur. Dumlupınar Üniversitesi, Kütahya il merkezinde: Evliya Çelebi Merkez ve Germiyan Yerleşkesi olmak üzere iki yerleşkeye, 11 ilçede de ayrı bina ve yerleşke alanlarına sahiptir. Üniversite bünyesinde bulunan 10 fakülte, 4 yüksekokul; 4 enstitü, 12 meslek yüksekokulu ve 24 araştırma ve uygulama merkezinde 1216 akademik personel çalışmalarını yürütmekte, 49944 öğrenci de öğrenim görmektedir.', 'dumlupnar-universitesi', null, null, 'Kütahya', null, '/m/026j72d'), ('48', 'Düzce Üniversitesi', 'Düzce Üniversitesi Konuralp Yerleşkesi Konuralp, Merkez/Düzce 81620', 'http://www.duzce.edu.tr/dosya/logo/DUE.jpg', 'http://www.duzce.edu.tr/', 'Düzce Üniversitesi 17 Mart 2006 tarihinde Düzce il sınırları içerisinde toplumsal ve sürdürülebilir kalkınma alanlarında disiplinler arası proje işbirlikleriyle öncü, eğitim-öğretim ve bilimsel gelişme alanlarında ulusal ve uluslararası düzeyde tanınan, çağdaş, yenilikçi, güvenilir, saygın ve tercih edilen bir üniversite olma vizyonuyla kurulmuştur. 11 fakültesi, 4 yüksekokulu, 9 meslek yüksekokulu, 3 enstitüsü, 4 araştırma merkezi bulunan Düzce Üniversitesi\'nde 1.400 akademik personel bilimsel çalışmalarını Atatürk ilke ve devrimlerine bağlı, ülkenin gelişmesine ve çağdaş uygarlık seviyesine ulaşmasına katkı sağlayacak meslek insanları yetiştirme, araştırma ve topluma hizmet alanlarında evrensel değerler üretme, ulusal ve uluslararası düzeyde iş birlikleri kurma, sürdürülebilir kalkınmaya öncülük misyonuyla yürütmektedir. Konuralp Yerleşkesi\'nde konumlanan üniversitenin çevre ilçelerde meslek yüksekokulları mevcuttur. Düzce Üniversitesi\'nde 20.000 kadar öğrenci öğrenim görme imkanı bulmaktadır.', 'duzce-universitesi', '31.17547', '40.902898', 'Düzce', null, '/m/0r8n744'), ('49', 'Ege Üniversitesi', 'Ege Üniversitesi Kampüsü 35100, Bornova-İZMİR', 'http://www.egelogo.ege.edu.tr/download/diger/ege60/ege60.png', 'http://www.ege.edu.tr/', '', 'ege-universitesi', '27.2243178', '38.4573028', 'İzmir', null, '/m/0ctt6c'), ('50', 'Erciyes Üniversitesi', 'Erciyes Üniversitesi Rektörlüğü 38039 Kayseri - Türkiye', 'http://guzelsanat.erciyes.edu.tr/logolar/e_u_logo_jpg_96dpi_RGB.jpg', 'http://en.erciyes.edu.tr/', 'Erciyes Üniversitesi 1978 yılında Kayseri\'de devlet üniversitesi statüsünde bilimsel çalışmalara, bilgi ve teknoloji üretimine ve sosyal, kültürel, sanat ile spor alanlarına katkı sağlayan; uluslararası nitelikte öğrenci ve öğretim elemanı yapısına sahip; bünyesinde Türkiye’de önde gelen ve Dünya\'da saygın araştırma merkezleri bulunduran; yerel, evrensel ve etik değerlere sahip öncü bir üniversite olma vizyonuyla Kayseri\'de kurulmuştur. Kayseri Merkez Kampüsü, Seyrani, Tomarza olmak üzere 3 yerleşkesi bulunan üniversitenin bünyesinde 18 fakülte, 3 yüksekokul, 9 meslek yüksekokulu, 7 enstitü, 6 bölüm, 38 araştırma merkezi faaliyet göstermektedir. Üniversitede, 2014 - 2015 öğretim yılı itibariyle 2300\'e yakın akademik personel görev yapmakta olup yaklaşık 50.000 öğrenci de eğitim almaktadır.', 'erciyes-universitesi', '35.5235473', '38.7005635', 'Kayseri', null, '/m/09yxhj'), ('51', 'Erzincan Üniversitesi', 'Erzincan Üniversitesi Rektörlüğü Fatih Mahallesi 24100-ERZİNCAN', 'http://eski.erzincan.edu.tr/userfiles/menu/images/Erznc_%20%DCni.jpg', 'http://www.erzincan.edu.tr', 'Erzincan Üniversitesi 11.07.1992 tarihinde Anadolu’da bir dünya üniversitesi olma vizyonuyla Erzincan il sınırları içerisinde kurulmuştur. Erzincan merkezde bulunan rektörlük binası, Yalnızbağ Yerleşkesi, meslek yüksekokulu ve yüksekokul binaları ile üniversitenin yerleşkeleri Erzincan il sınırları içerisinde dağılım göstermiştir. Üniversite bünyesinde 9 fakülte, 3 enstitü, 5 yüksekokul, 11 meslek yüksekokulu ve 20 araştırma ve uygulama merkezi bulunmaktadır. Bu birimlerde 19.500 öğrenci öğrenim görmektedir. 855 Akademik Personel, 372 İdari Personeli ile Erzincan Üniversitesi, insan merkezli bir eğitim anlayışıyla, bilimi ve aklı esas alarak ülkemizin değerleri ve hedefleri doğrultusunda üstün nitelikli bireyler yetiştirme; uluslararası ölçekte bilim ve teknoloji üreterek bölgenin ve ülkenin sürdürülebilir kalkınmasına katkıda bulunma ve toplumun sorunlarını çözmeye yönelik çalışmalar yapma misyonuyla eğitim hayatını sürdürmektedir.', 'erzincan-universitesi', null, null, 'Erzincan', null, '/m/0br_gkk'), ('52', 'Erzurum Teknik Üniversitesi', 'Çat Yolu Üzeri 4. Km / Erzurum', 'http://www.tasarimyarismalari.com/wp-content/uploads/2012/05/etu-logo-3.jpg', 'http://www.erzurum.edu.tr/', 'Erzurum Teknik Üniversitesi, Erzurum’da ikinci bir devlet üniversitesi olarak 21.07.2010 tarihinde toplumla iletişim halinde bulunarak bölgenin problemlerine bilimsel çözümler üretecek sosyal ve ekonomik çalışmalar yapan, yaşam boyu öğrenmeyi temel ilke kabul ederek bilginin ve sanatın tüm toplum katmanlarına yayılmasına katkıda bulunan ve bölgesinde yüksek teknoloji konularında araştırma altyapısı eksikliğini gidererek ileri teknoloji konularında araştırma üssü olmayı hedefleyen bir Dünya Üniversitesi olma amacıyla kurulmuştur. Çat yolu 4. Km\'deki rektörlük binasının yanı sıra Havalimanı Yolu Üzeri\'ndeki derslikler binası ile çalışmalarını yürüten üniversitenin merkez kampüs inşaatı sürmektedir. 6 fakülte, 3 enstitü ve 1 yüksekokulun bulunduğu üniversitede 173 akademik personel görev almakta, 1835 öğrenci öğrenim görmektedir.', 'erzurum-teknik-universitesi', null, null, 'Erzurum', null, '/m/0r8nn3k'), ('53', 'Eskişehir Osmangazi Üniversitesi', 'Meşelik Kampüsü, Atatürk Bulv., Osmangazi, 26480 Eskişehir, Türkiye', 'http://yos.ogu.edu.tr/images/logo.png', 'http://www.ogu.edu.tr', 'Eskişehir Osmangazi Üniversitesi, 18 Ağustos 1993\'de Eskişehir\'de Ulusal ve evrensel değerlere sahip, bilim ışığında araştırma-geliştirme yapabilen, girişimci, katılımcı, paylaşımcı, bilim ve teknoloji üreterek topluma katkı sağlayan mezunlar ve bilim insanları yetiştiren, çağdaş hizmetler sunan, çalışanlarının haklarını koruyan ve onlara saygılı, ulusal ve uluslararası düzeyde saygınlığı olan, alanında öncülük eden ve çalışmaları örnek alınan bir üniversite olma vizyonu ile Eskişehir\'de kurulmuştur. Merkez yerleşkesi Meşelik olan üniversitenin, Bademlik, Çamlık, Ali Numan Kıraç, Organize Sanayi Bölgesi, Sivrihisar, Mahmudiye olmak üzere 7 yerleşkesi bulunmaktadır. Üniversite bünyesinde 10 fakülte, 2 yüksekokul, 4 meslek yüksekokulu, 5 enstitü, 27 araştırma ve uygulama merkezi bulunmaktadır. Bu birimlerde 29.000 öğrenci öğrenim görmektedir.', 'eskisehir-osmangazi-universitesi', '30.4849402', '39.7510832', 'Eskişehir', null, '/m/02qfpv5'), ('54', 'Fırat Üniversitesi', '', 'http://logovector.org/wp-content/uploads/logos/png/f/firat_universitesi_logo.png', 'http://www.firat.edu.tr/', 'Fırat Üniversitesi 1975 yılında bilimin parlayan yıldızı sloganıyla Elazığ\'da devlet üniversitesi olarak kurulmuştur. Elazığ Merkez\'de bulunan kampüsü ve çevre ilçelerindeki meslek yüksek okulları ile faaliyetlerini sürdürmektedir. 36091 öğrencinin öğrenim gördüğü üniversite bünyesinde 14 Fakülte, 4 Yüksekokul, 1 Devlet Konservatuarı, 9 Meslek Yüksekokulu, 4 Enstitü, 23 araştırma ve uygulama merkezi ve bu birimlerde akademik faaliyetlerini sürdüten 1697 öğretim üyesi bulunmaktadır.', 'frat-universitesi', '39.2054067', '38.6776247', 'Elazığ', null, '/m/03mgm2_'), ('55', 'Galatasaray Üniversitesi', 'Çırağan Cad. No:36, 34349 Ortaköy/İstanbul', 'http://istanbuletkinlik.net/wp-content/uploads/2016/03/galatasaray-%C3%BCniversitesi-bahar-%C5%9Fenlikleri-%C5%9Fenli%C4%9Fi-2016.jpeg', 'http://www.gsu.edu.tr/', '', 'galatasaray-universitesi', null, null, 'İstanbul', null, '/m/0283zqx'), ('56', 'Gazi Üniversitesi', 'Gazi Üniversitesi Rektörlüğü, 06500 Teknikokullar ANKARA', 'http://www.freelogovectors.net/wp-content/uploads/2013/04/gazi_universitesi_logo.jpg', 'http://gazi.edu.tr/', 'Gazi Üniversitesi, Cumhuriyet tarihinin ilk üniversitesi olarak 1926 yılında Ankara\'da devlet üniversitesi olarak, bilim ve teknolojiden sanat ve spora kadar uzanan geniş bir yelpazede özgün araştırmaları, üst düzey eğitimi, yaratıcı faaliyetleri ve topluma hizmeti ile ulusal ve uluslararası düzeyde saygın ve lider bir üniversite olma vizyonuyla kuruldu. Rektörlük binasının bulunduğu Merkez Yerleşkesi ile beraber Beşevler, Emek, Maltepe, Gölbaşı, Çubuk, Ostim ve Polatlı olmak üzere toplam 8 yerleşkesi bulunan, 77 bin öğrencinin öğrenim gördüğü üniversite 21 fakültesi, 4 yüksekokulu, 1 Türk Müziği Devlet Konservatuvarı, 11 meslek yüksekokulu, 48 araştırma merkezi ve 7 enstitüsü bünyesinde çalışan 4000 akademik personeli ile Gazi Üniversitesi adını aldığı Gazi Mustafa Kemal Atatürk\'e yaraşır bir yüksek öğretim kurumu olma iddiasını devam ettirmektedir.', 'gazi-universitesi', '32.8225332', '39.9400862', 'Ankara', null, '/m/07h638'), ('57', 'Gaziantep Üniversitesi', 'Üniversite Bulvarı 27310 Şehitkamil - Gaziantep, TÜRKİYE', 'http://www.freelogovectors.net/wp-content/uploads/2012/06/gaziantep-universitesi-logo1.jpg', 'http://www.gantep.edu.tr', '', 'gaziantep-universitesi', '37.3134478', '37.0359319', 'Gaziantep', null, '/m/0dcw27'), ('58', 'Gaziosmanpaşa Üniversitesi', 'Gaziosmanpaşa Üniversitesi, 60250 Tokat / TÜRKİYE', 'http://danismendsempozyumu.gop.edu.tr/images/gop_logo.jpg', 'http://www.gop.edu.tr', 'Adını Plevne Kahramanı Gazi Osman Paşa\'dan alan Üniversite 03.07.1992 tarihinde Tokat il sınırları içerisinde devlet üniversitesi statüsünde, eğitim, araştırma ve uygulamada ülkemizde önde gelen ve uluslararası düzeyde tanınan bir üniversite olma misyonuyla kurulmuştur. Taşlı Çiftlik Kampüsü\'nde faaliyetlerini sürdüren üniversitenin bünyesinde Şehir Yerleşkesin\'in yanı sıra çevre ilçelerde meslek yüksekokulları bulunmaktadır. 11 fakülte, 11 yüksekokul, 15 meslek yüksekokulu, 4 enstitü, 13 araştırma ve uygulama merkezinin bulunduğu üniversitede 28.645 öğrenim görmektedir. Evrensel değerlere sahip, insana, topluma ve doğaya saygılı, donanımlı, ülkenin sosyokültürel ve ekonomik gelişimine katkı sağlayacak bireyler yetiştirme, ulusal ve uluslararası sorunlara çözümler üretme, üniversitenin birikimlerini insanlığın hizmetine sunma misyonuyla hareket eden üniversitede 1130 akademik personel çalışma yürütmektedir.', 'gaziosmanpasa-universitesi', '36.546463', '40.325182', 'Tokat', null, '/m/0h0gkd'), ('59', 'Gebze Teknik Üniversitesi', 'Gebze Teknik Üniversitesi Rektörlüğü, P.K: 141 41400 Gebze/KOCAELİ ', 'http://www.gtu.edu.tr/files/html/mobil/gtu_logo_tr_500.png', 'http://www.gyte.edu.tr/', 'Gebze Teknik Üniversitesi 11 Temmuz 1992 tarihinde araştırma ve teknoloji üretimi öncelikli bir ihtisas üniversitesi olarak Kocaeli il sınırları içerisinde Dünya’da saygın üniversiteler arasında yer alan bir ihtisas üniversitesi olma vizyonuyla devlet üniversitesi statüsünde kurulmuştur. Bünyesinde bulunan 4 fakülte, 10 enstitü ve 4 araştırma ve uygulama merkezinde 5000 öğrenci eğitim görmektedir. 165 doktoralı öğretim elemanının çalıştığı üniversitede, bilimselliğinin ve üretkenliğinin göstergelerinden biri olan öğretim üyesi başına düşen uluslararası yayın sayısı bakımından devlet üniversiteleri arasında ilk sıralarda yer almaktadır. Gebze Teknik Üniversitesi, Dünya standartlarında lisans ve lisansüstü seviyede eğitim vermeyi, temel ve uygulamalı bilimsel ve teknolojik araştırmalar yapmayı ve bunları saygın uluslararası dergi ve kitaplarda yayınlamayı temel varlık sebebi olarak kabul etmiştir.', 'gebze-teknik-universitesi', '29.36524', '40.8089868', 'Kocaeli', null, '/m/02rgmyg'), ('60', 'Giresun Üniversitesi', 'Güre, 28200 Gaziler / Merkez/Giresun Merkez/Giresun, TÜRKİYE', 'http://www.resimle.net/data/media/350/Giresun__universitesi_logosu_amblemi.JPG', 'http://www.giresun.edu.tr/', 'Giresun Üniversitesi Giresun Üniversitesi, 2006 yılında bağlı olduğu KTÜ\'den ayrılarak Giresun\'da yaşanacak değişim ve gelişmelerle oluşacak yarının eğitim, bilim ve teknoloji dünyasında uluslararası öneme sahip bir bilgi limanı olma vizyonuyla açılan devlet üniversitesidir. Giresun Üniversitesi, Merkez, Güre, Gazipaşa, Nizamiye, Piraziz, Bulancak, Keşap, Espiye, Tirebolu, Görele, Eynesil, Dereli, Alucra, Şebinkarahisar olmak üzere 10 yerleşkede eğitim öğretim faaliyetlerini sürdürmektedir. Giresun Üniversitesi bünyesinde 10 Fakülte, 11 Meslek Yüksekokulu, 5 Yüksekokul, 3 Enstitü, 1 Devlet Konservatuvarı ve 15 araştırma ve uygulama merkezi bulunmaktadır. Bu birimlerde 28105 öğrenci öğrenim görmektedir.', 'giresun-universitesi', '38.322605', '40.9144389', 'Giresun', null, '/m/02q06k_'), ('61', 'Gülhane Askeri Tıp Akademisi', 'Gülhane Askeri Tıp Akademisi Komutanlığı General Dr.Tevfik Sağlam Cd. Etlik / Ankara Posta Kodu: 06010', 'http://seeklogo.com/images/G/gulhane-askeri-tip-akademisi-gata-logo-0B116E49FF-seeklogo.com.gif', 'http://www.gata.edu.tr', '', 'gulhane-askeri-tp-akademisi', null, null, 'Ankara', null, null), ('62', 'Gümüşhane Üniversitesi', 'Bağlarbaşı Mahallesi 29100 / Gümüşhane', 'http://www.gumushane.edu.tr/logolar/ghu_logo_b1.jpg', 'http://www.gumushane.edu.tr', 'Gümüşhane Üniversitesi 31 Mayıs 2008 tarihinde Gümüşhane ilinde kurulan devlet üniversitesidir. Gümüşhane Üniversitesi bünyesinde 3 Enstitü, 6 Fakülte, 2 Yüksekokul, 8 Meslek Yüksekokulu ve 5 Araştırma ve Uygulama Merkezi bulunmaktadır. Bu birimlerin çatısı altında 631 akademik personel ve 310 idari personel çalışmalarını yürütmektedir. 15.500 öğrencinin öğrenim gördüğü Gümüşhane Üniversitesi gelişen ve geliştiren üniversite sloganı eğitim faaliyetlerini sürdürmektedir.', 'gumushane-universitesi', '39.5157769', '40.4364278', 'Gümüşhane', null, '/m/0r8npv_'), ('63', 'Hacettepe Üniversitesi', 'Hacettepe Üniversitesi Rektörlüğü, Sıhhiye / ANKARA', 'http://logovector.org/wp-content/uploads/logos/png/h/hacettepe_universitesi_logo.png', 'http://hacettepe.edu.tr', 'Hacettepe Üniversitesi ilham verici bir dünya markası olan; öğrencisi, personeli ve mezunu olmaktan gurur duyulan; değişime ve gelişime liderlik eden bir üniversite olma vizyonu ile 8 Temmuz 1967’de ile tıp, sağlık bilimleri, fen ve sosyal bilimler fakülteleri ile hizmet vermeye başlamıştır. 14 fakülte, 14 enstitü, 1 yüksekokul, 3 meslek yüksekokulu, 1 konservatuvar, Teknokent ve Teknoloji Transfer Merkezi, 85 uygulama ve araştırma merkezi, öğrenci kulüpleri, spor ve kültür tesisleri, öğrenci kasabası, yurtlar, laboratuvarlar, kütüphaneler, bilgi-iletişim altyapısı, sanat müzesi, kongre merkezleri ile merkez yerleşkesinin Sıhhıye olduğu dört yerleşkeye ( Beytepe, Beşevler, Polatlı ) sahiptir. Bilim, teknoloji, görsel ve işitsel sanat alanlarında yürüttüğü araştırmalar ve verdiği eğitim-öğretimle, değişime ve gelişime açık bireyler yetiştirmeyi, her alandaki birikimini toplum yararına sunmayı görev edinen Hacettepe bünyesinde 3495 akademik personel görev yapmakta, 36112 öğrenci de öğrenim görmektedir.', 'hacettepe-universitesi', '32.7319499', '39.8692017', 'Ankara', null, '/m/047s3b'), ('64', 'Hakkari Üniversitesi', 'Hakkari Üniversitesi / Zeynel Bey Yerleşkesi, Kıran Mahallesi HAKKARİ', 'http://seeklogo.com/images/H/hakkari-universitesi-logo-1560886614-seeklogo.com.gif', 'http://www.hu.edu.tr/', '', 'hakkari-universitesi', null, null, 'Hakkari', null, '/m/0r8nypc'), ('65', 'Harran Üniversitesi', 'Harran Üniversitesi Rektörlüğü, Yenişehir Yerleşkesi, 63300 Şanlıurfa', 'http://www.harran.edu.tr/harran/images/logo_tr.gif', 'http://www.harran.edu.tr/', '', 'harran-universitesi', '39.0004058', '37.1708119', 'Şanlıurfa', null, '/m/0cpbcvw'), ('66', 'Hava Harp Okulu', 'Hava Harp Okulu Komutanlığı, (34149) Yeşilyurt / İSTANBUL ', 'http://seeklogo.com/images/H/hava_harp_okulu-logo-3AD9F5E3FB-seeklogo.com.gif', 'http://www.hho.edu.tr/', '', 'hava-harp-okulu', null, null, 'İstanbul', null, '/m/02pvkwz'), ('67', 'Hitit Üniversitesi', 'Hitit Üniversitesi, Kuzey Kampüsü, Çevre Yolu Bulvarı 19030 Çorum / TÜRKİYE', 'http://cdn.hitit.edu.tr/hitit/files/41596_1603071112385.jpg', 'http://www.hitit.edu.tr/', 'Hitit Üniversitesi, 17 Mart 2006 tarihinde Çorum\'da demokratik şeffaf, özgürlükçü, ehliyet ve liyakata dayalı bir yönetim anlayışıyla ülkemiz ve dünya üniversiteleri arasında daha saygın bir yere getirmek; üretken girişimci, öncü, alanında söz sahibi mezunlar yetiştirerek, bölgemize, ülkemize ve insanlığa büyük katkılar sağlayan, tercih edilebilirliği ve bilimsel kalitesi sürekli artan bir üniversite olma amacıyla kurulmuş devlet üniversitesidir. Hitit Üniversitesi\'nin merkez yerleşkesi Kuzey Kampüsü\'ndedir. 12856 öğrencinin öğrenim gördüğü 8 fakülte, 2 yüksekokul, 3 enstitü 7 meslek yüksekokulu ve 11 araştırma ve uygulama merkezinde 574 akademik personel, 332 idari personel ve 11 Geçici personel olmak üzere toplam 917 personel ile hizmet vermektedir.', 'hitit-universitesi', null, null, 'Çorum', null, '/m/0cpbls6'), ('68', 'Hoca Ahmet Yesevi Uluslararası Türk-kazak Üniversitesi', '', null, 'http://www.ayu.edu.tr/', '', 'hoca-ahmet-yesevi-uluslararas-turk-kazak-universitesi', null, null, 'Türkistan (Kazakistan)', null, '/m/0w7l654'), ('69', 'Iğdır Üniversitesi', 'Iğdır Üniversitesi Rektörlüğü, Suveren Kampüsü, 76000 / IĞDIR', 'http://www.universiteyurtlari.com/img/_large_20110629__8966333270.png', 'http://www.igdir.edu.tr/home-tr', '', 'igdr-universitesi', null, null, 'Iğdır', null, '/m/0r8n54t'), ('70', 'İnönü Üniversitesi', 'İnönü Üniversitesi Merkez Kampüsü Malatya, Türkiye', 'http://www.baharfestivalleri.com/wp-content/uploads/2015/01/In%C3%B6n%C3%BC_%C3%BCniversitesi_logo.png', 'http://www.inonu.edu.tr/', 'İnönü Üniversitesi 1975 yılında Malatya\'da sağlık hizmetleri başta olmak üzere; eğitim, bilimsel araştırma ve sanat alanlarında uluslararası düzeyde saygın bir üniversite olma vizyonuyla kurulan devlet üniversitesidir. İnönü Üniversitesi 7000 dekarlık merkez kampüsünün yanında, 620 dönümlük Battalgazi Kampüsünde ve 2’si şehir merkezinde 4’ü ilçelerde olmak üzere toplam 6 yerleşkesinde eğitim-öğretim, bilimsel araştırma ve uygulama faaliyetlerini sürdürmektedir. 38.000 öğrencinin öğrenim gördüğü üniversitenin 13 fakülte 1’i devlet konservatuvarı olmak üzere 5 yüksekokul, 12 meslek yüksekokulu, 5 enstitü, 1 teknokent, 26 araştırma ve uygulama merkezinde yaklaşık 1.600 akademik personel görev almaktadır.', 'inonu-universitesi', '38.4352081', '38.3380823', 'Malatya', null, '/m/0d5b41'), ('71', 'İskenderun Teknik Üniversitesi', 'İskenderun Teknik Üniversitesi, Merkez Kampüs, 31200, İskenderun/Hatay', 'http://iste.edu.tr/files/dikey_logo.png', 'http://www.istek.edu.tr/', 'İskenderun Teknik Üniversitesi, 31.3.2015 tarihinde Hatay\'ın İskenderun ilçesinde devlet statüsünde kurulmuş teknik üniversitedir. İskenderun Teknik Üniversitesini oluşturan fakültelerin çoğu Mustafa Kemal Üniversitesi\'nden ayrılarak yeni üniversiteye bağlanmıştır. 13.000 öğrencinin öğrenim gördüğü 8 fakülte, 6 enstitü, 3 yüksekokul, 1 konservatuvar ve 5 meslek yüksekokuluna 1350 akademik personel kadrosu tahsis edilmiştir.', 'iskenderun-teknik-universitesi', null, null, 'Hatay', null, '/g/11b7_m4m15'), ('72', 'İstanbul Medeniyet Üniversitesi', '', 'http://bikifi.com/wp-content/uploads/istanbul-medeniyet-universitesi-logosu.jpg', 'http://www.medeniyet.edu.tr', '', 'istanbul-medeniyet-universitesi', null, null, 'İstanbul', null, '/m/0hgmf9z'), ('73', 'İstanbul Teknik Üniversitesi', 'İTÜ Ayazağa Kampüsü, Rektörlük Binası, 34469 Maslak-İSTANBUL', 'http://www.freelogovectors.net/wp-content/uploads/2012/05/itu-istanbul-teknik-universitesi-logo.jpg', 'http://www.itu.edu.tr', 'İstanbul Teknik Üniversitesi (İTÜ), 1773 yılında Mühendishane-i Bahrî-i Hümâyûn adıyla İstanbul\'da kurulmuş devlet üniversitesidir. İTÜ\'de Ayazağa, Gümüşsuyu, Maçka, Taşkışla ve Tuzla olmak üzere 5 kampüste, bilim, teknoloji ve sanatta, uzmanlığı ile uluslararası, lider bir üniversite olma vizyonuyla 13 fakültede 39 lisans programı ve 6 enstitüde yüksek lisans ve doktora programlarında eğitim verilmektedir. 2.093 akademik personelin görev yaptığı üniversitede 360 laboratuvar ve 13 araştırma merkezi bulunmaktadır. 23 akredite mühendislik programı ile dünyanın en fazla ABET Akreditasyonuna sahip üniversitesi olan İTÜ\'de 32.307 öğrenim görmektedir.', 'istanbul-teknik-universitesi', '28.9902327', '41.041398', 'İstanbul', null, '/m/037m4f'), ('74', 'İstanbul Üniversitesi', 'İstanbul Üniversitesi Merkez Kampüsü, 34452 Beyazıt/Fatih-İstanbul', 'http://www3.istanbul.edu.tr/genel/idari/basinhalk/TANITIM/IUKK_tasarim/ornekler/IU_Logo.jpg', 'http://www.istanbul.edu.tr', '18 Kasım 1933\'te Doğu ile Batıyı, geçmişle geleceği buluşturan, ülkemize ve insanlığa yararlı bilgi üreten ve yetkin bireyler yetiştiren öncü üniversite olma misyonuyla kurulan İstanbul Üniversitesi\'nin kökleri 30 Mayıs 1453\'e kadar uzanmaktadır. İstanbul Üniversitesi, Beyazıt Merkez, Laleli-Vezneciler, Vefa, Horhor, Avcılar, Çapa, Cerrahpaşa, Şişli, Kadıköy, Bahçeköy, Bakırköy ve Büyükçekmece olmak üzere 12 farklı yerleşkede faaliyetlerini sürdürmektedir. 178.901 öğrencinin öğrenim gördüğü 20 fakülte 8 yüksekokul, 17 enstitü, 61 uygulama ve araştırma merkezi ve devlet konservatuvarında, 5100 akademik, 7000 idari personel görev yapmaktadır.', 'istanbul-universitesi', '28.9642283', '41.0108739', 'İstanbul', null, '/m/033tgd'), ('75', 'İvane Javakhishvili Tiflis Devlet Üniversitesi', '', 'http://www.tempuspact.eu/ckfinder/userfiles/files/lOGO-TSARTSERA.jpg', 'https://www.tsu.ge/en/', '', 'ivane-javakhishvili-tiflis-devlet-universitesi', null, null, 'Tİflis (Gürcistan)', null, null), ('76', 'İzmir Katip Çelebi Üniversitesi', 'İzmir Kâtip Çelebi Üniversitesi Balatçık Kampüsü, 35620 Çiğli İzmir', 'http://ikc.edu.tr/public/images/logolar/ikc_ana.png', 'http://www.ikc.edu.tr/', 'Kâtip Çelebi Üniversitesi, 2010 yılında  bilgiyi üreten, kullanan ve paylaşan öncü bir üniversite olma amacıyla kurulan İzmir\'in 4. devlet üniversitesidir. Üniversite, Çiğli\'de bulunan Balatçık Kampüsü\'nde konumlanmıştır. Üçüncü kuşak ya da “Dünya Üniversitesi” konsepti ile \"Farklı Düşüncelerin Sesi\" sloganıyla eğitim veren 4636 öğrencinin öğrenim gördüğü üniversite bünyesinde 12 fakülte, 3 enstitü ve 3 yüksekokulu bulunmakta, Bu birimlerde ise  695 akademik personel akademik çalışmalarını yürütmektedir.', 'izmir-katip-celebi-universitesi', null, null, 'İzmir', null, '/m/0wk9cl3'), ('77', 'İzmir Yüksek Teknoloji Enstitüsü', 'İzmir Yüksek Teknoloji Enstitüsü, Urla, İzmir 35430 Türkiye', 'http://ilan.memurlar.net/common/job/organization/images/c8083ad6-8b27-e411-a1b0-14feb5cc13c9/headline.jpg', 'http://www.iyte.edu.tr/', 'İzmir Yüksek Teknoloji Enstitüsü 11 Temmuz 1992 tarihinde özellikle teknolojik alanda üst düzeyde eğitim, öğretim ve araştırma yapma temel amacı ile Türkiye\'nin teknoloji üssü sloganıyla kurulmuş bir devlet üniversitesidir. İYTE\'nin yerleşkesi İzmir\'in Urla ilçesinde konumlanmıştır. 4073 öğrencinin öğrenim gördüğü 3 fakülte, 1 enstitü, 1 yüksekokul ve 5 araştırma merkezinde 534 akademik personel ile 384 idari personel görev almaktadır.', 'izmir-yuksek-teknoloji-enstitusu', '26.642493', '38.3191', 'İzmir', null, '/m/02rgn1y'), ('78', 'Kafkas Üniversitesi', 'Kafkas Üniversitesi Rektörlüğü, Merkez, 36000 Kars, TÜRKİYE', 'http://www.ohder.org.tr/wp-content/uploads/2015/11/s10350.jpg', 'http://www.kafkas.edu.tr', 'Kafkas Üniversitesi 11 Temmuz 1992 tarihinde Dünya\'ya açılan bilim kapısı sloganı ile Kars il sınırları içerisinde kurulmuş bir devlet üniversitesidir. Kafkasya Üniversiteler Birliği\'nin kurucu üyelerinden olan Kafkas Üniversitesi, 8 ayrı yerleşkede, 10 fakülte, 3 yüksekokul, 6 meslek yüksekokulu, 1 devlet konservatuvarı, 3 enstitü, 17 araştırma merkezi olmak üzere toplam 40 akademik birime, 854 öğretim elemanına ve yaklaşık 17.000 öğrenci kapasitesine sahiptir.', 'kafkas-universitesi', null, null, 'Kars', null, '/m/0g9sp50'), ('79', 'Kahramanmaraş Sütçü İmam Üniversitesi', '', 'http://vektorellogo.com/sites/default/files/styles/logo_onizleme/public/thumbnail_file/kahramanmaras-sutcu-imam-universitesi-logo-vector.png?itok=rCTgKK1y', 'http://www.ksu.edu.tr/', '', 'kahramanmaras-sutcu-imam-universitesi', null, null, 'Kars', null, '/m/03mbscs'), ('80', 'Kara Harp Okulu', 'Devlet Mah. Kara Harp Okulu Cd. Ankara / Türkiye, 06654 ', 'http://seeklogo.com/images/K/kara-harp-okulu-logo-0CD78E8D56-seeklogo.com.gif', 'http://www.kho.edu.tr/', '', 'kara-harp-okulu', null, null, 'Ankara', null, '/m/0fwyxt'), ('81', 'Karabük Üniversitesi', '', 'http://www.universiteyurtlari.com/img/_large_20110629__7587854266.png', 'http://www.kho.edu.tr/', '', 'karabuk-universitesi', '32.6584529', '41.220278', 'Karabük', null, '/m/0h959kg'), ('82', 'Karadeniz Teknik Üniversitesi', 'Karadeniz Teknik Üniversitesi, 61080, Trabzon, Türkiye', 'http://logovector.org/wp-content/uploads/logos/png/k/karadeniz_teknik_universitesi_logo.png', 'http://www.ktu.edu.tr', '', 'karadeniz-teknik-universitesi', '39.773709', '40.995927', 'Trabzon', null, '/m/025s1kb'), ('83', 'Karamanoğlu Mehmetbey Üniversitesi', 'Karamanoğlu Mehmetbey Üniversitesi, Yunus Emre Yerleşkesi, 70100 KARAMAN / TÜRKİYE ', 'http://www.kmu.edu.tr/resim/kmu-amblem(jpg).jpg', 'http://www.kmu.edu.tr', 'Karamanoğlu Mehmetbey Üniversitesi, 28 Mayıs 2007 tarihinde bilgi çağının gerektirdiği nitelikleri taşıyan, insanlık onurunu her şeyin üstünde tutan, hayalleri ve idealleri olan bireyler yetiştiren ve gıda sektörünün iyileştirilmesi ile Türk dilinin araştırılması, yaygınlaştırılması, Türkçe bilincinin yerleştirilmesi konularında öncü çalışmalar yapan “sıradan değil, aranan” bir üniversite olma vizyonuyla Karaman\'da devlet üniversitesi statüsünde kurulmuştur. Ünivesitenin ana yerleşkesi Yunus Emre yerleşkesidir. Bunun dışında Üniversite Ermenek ve Kazım Karabekir Yerleşkeleri\'nde de konumlanmıştır. 11150 öğrencinin öğrenim gördüğü 6 fakülte, 2 yüksekokul, 2 enstitü, 5 meslek yüksekokulu ve 6 araştırma ve uygulama merkezinde 2014 yılı verilerine göre 466 akademik personel görev almaktadır.', 'karamanoglu-mehmetbey-universitesi', null, null, 'Karaman', null, '/m/0gjbfkd'), ('84', 'Kastamonu Üniversitesi', 'Cumhuriyet Meydanı., 37150 Kastamonu, TÜRKİYE', 'http://logovector.org/wp-content/uploads/logos/png/k/kastamonu_universitesi_logo.png', 'http://www.kastamonu.edu.tr/', 'Kastamonu Üniversitesi 01 Mart 2006 tarihinde sunduğu bilimsel bilgi ve sağladığı özgür eğitim ortamıyla ulusal ve uluslararası seviyede tercih edilen bir ‘dünya üniversitesi’ olarak ön sıralarda yer alma amacıyla Kastamonu\'da devlet üniversitesi statüsünde kurulmuştur. Üniversitenin ana kampüsü, Daday Yolu 3. km\'de, 237 hektarlık alanda kurulu “Kuzeykent Kampüsü\'dür. Bunun dışında üniversite çevre ilçelerde meslek yüksekokulları ile konumlanmıştır. 22777 öğrencinin öğrenim gördüğü üniversitenin 11 fakülte, 2 enstitü, 4 yüksekokul, 11 meslek yüksekokulu ve 18 araştırma ve uygulama merkezinde, 654 akademik personel görev almaktadır.', 'kastamonu-universitesi', null, null, 'Kastamonu', null, '/m/0bbvf48'), ('85', 'Kilis 7 Aralık Üniversitesi', 'Mehmet Sanlı Mah. Doğan Güreş Paşa Bul. No:134 KİLİS', 'http://www.kilis.edu.tr/images/logomuz.png', 'http://www.kilis.edu.tr', '', 'kilis-7-aralk-universitesi', null, null, 'Kilis', null, '/m/0r8lln7'), ('86', 'Kocaeli Üniversitesi', 'Kocaeli Üniversitesi, Umuttepe Yerleşkesi 41380, İzmit/KOCAELİ', 'http://bhi.kocaeli.edu.tr/amblem/logorgb.jpg', 'http://www.kocaeli.edu.tr/', '1976 yılında \"Kocaeli Devlet Mühendislik ve Mimarlık Akademisi\" adı altında Elektrik, Makine, Temel Bilimler Fakülteleri ve Yabancı Diller Enstitüsü olarak kurulan Kocaeli Üniversitesi 3 Temmuz 1992 tarihinde Kocaeli Üniversitesi olarak \"Bilgi Aktaran Üniversiteden, Bilgi Üreten Üniversiteye...\" sloganıyla devlet üniversitesi statüsünde Türkiye\'nin sanayi kenti Kocaeli\'de eğitim hayatına başlamıştır. Yakında arkeolojik çalışmaların yürütüleceği 800 dönümü sit alanı içerisinde bulunan 6500 dönümlük Umuttepe Yerleşkesi üniversitenin ana yerleşkesidir. Bunun dışnda Üniversite Umuttepe, Yeniköy, Yahya Kaptan, Anıtpark, Arslanbey, Değirmendere, Derbent, Gölcük, Hereke, Uzunçiftlik, Kandıra, Karamürsel Köseköy, Yuvacık ve Kullar Yerleşkeleri\'nde konumlanmıştır. 72.404 öğrencinin öğrenim gördüğü 12 Fakülte, 6 Yüksekokul, 1 Devlet Konservatuarı, 3 Enstitü, 9 Araştırma ve Uygulama merkezi, 27 Araştırma ve Uygulama Birimi, 21 Meslek Yüksekokulu\'nda 2051 akademik personel (244 Profesör, 194 Doçent, 485 Yardımcı Doçent, 267 Öğretim Görevlisi, 165 okutman, 22 uzman 674 Araştırma Görevlisi) ve 1765 idari personel görev almaktadır.', 'kocaeli-universitesi', '29.9301768', '40.8216655', 'Kocaeli', null, '/m/026l203'), ('87', 'Komrat Devlet Üniversitesi', '', null, 'http://www.kdu.md/tr/', '', 'komrat-devlet-universitesi', null, null, 'Komrat (Moldova)', null, '/m/0cpbfbv'), ('88', 'Kırgızistan-Türkiye Manas Üniversitesi', '', 'http://www.mailce.com/wp-content/uploads/kirgizistan-turkiye-manas-univeristesi.jpg', 'http://manas.edu.kg/index.php/tr/', '', 'krgzistan-turkiye-manas-universitesi', null, null, 'Bişkek (Kırgızistan)', null, '/g/12148w5l'), ('89', 'Kırıkkale Üniversitesi', 'Kırıkkale Üniversitesi Ankara Yolu 7. Km 71450 Yahşihan/Kırıkkale', 'http://kmy.kku.edu.tr/logolar/kku-yenilogo3-01.jpg', 'http://www.kku.edu.tr', 'Kırıkkale Üniversitesi 3 Temmuz 1992 tarihinde Kırıkkale\'de kurulmuş bir devlet üniversitesidir. Kırıkkale Üniversitesi, Kırıkkale\'de, Keskin\'de, Delice\'de ve Hacılar\'da olmak üzere dört yerleşkeye sahiptir. 27414 öğrencinin öğrenim gördüğü 12 fakülte, 3 enstitü, 1 yüksekokul, 7 meslek yüksekokulu ile 14 uygulama ve araştırma merkezinde 1149 akademik personel akademik çalışmalarını sürdürmektedir.', 'krkkale-universitesi', '33.451325', '39.871225', 'Kırıkkale', null, '/m/0cp3pv8'), ('90', 'Kırklareli Üniversitesi', 'Kültür Merkezi A Blok Merkez / KIRKLARELİ ', 'http://erasmus.klu.edu.tr/dosyalar/birimler/erasmus/dosyalar/resimler/klu-logo(1).png', 'http://www.kirklareli.edu.tr', '', 'krklareli-universitesi', null, null, 'Kırklareli', null, null), ('91', 'Mardin Artuklu Üniversitesi', 'Mardin Artuklu Üniversitesi, Artuklu Yerleşkesi, Diyarbakır Yolu, Artuklu / Mardin', 'http://formasyonhaber.com/wp-content/uploads/2016/06/artuklu-logo.jpg', 'http://www.artuklu.edu.tr/', 'Mardin Artuklu Üniversitesi 17 Mayıs 2007 tarihinde uluslararası düzeyde akademik yeterliliğini ispatlamış ve dikkate alınan bir sosyal bilimler üniversitesi olma vizyonuyla Mardin\'de kurulan devlet üniversitesidir Üniversitenin Mardin Şehir merkezine 5 km mesafede bulunan Mardin Artuklu Kampüsü, 7 km mesafede bulunan İstasyon Yerleşkesi ve Antik Mardin Kampüsü dışında Kızıltepe, Midyat, Nusaybin, Ömerli ilçelerinde de kampüsü bulunmaktadır. 8.000 civarı öğrencinin öğrenim gördüğü 6 Fakülte, 2 Yüksekokul, 6 Meslek Yüksekokulu, 3 Enstitü, 1 Devlet Konservatuvarı ve 4 Araştırma ve Uygulama Merkezi\'nde 438 Akademisyen ve 282 idari personel görev almaktadır.', 'mardin-artuklu-universitesi', null, null, 'Mardin', null, '/m/0r8nq60'), ('92', 'Marmara Üniversitesi', 'Marmara Üniversitesi, Göztepe Yerleşkesi 34722, Kadıköy - İstanbul', 'http://dosya.marmara.edu.tr/www/images/universite/marmara-universitesi.png', 'http://www.marmara.edu.tr/', '16 Ocak 1883 tarihinde Hamidiye Ticaret Mekteb-i Âlisi ismi altında eğitime başlayan Marmara Üniversitesi, 1982 yılında gerçekleştirilen düzenlemelerle, eğitim, bilim, teknoloji, sanat ve sporda öncü bir üniversite olma vizyonuyla İstanbul\'da devlet üniversitesi statüsünde kurulmuştur. Marmara Üniversitesi\'nin merkez kampüsü Göztepe Kampüsü\'dür. Bunun dışında üniversite Haydarpaşa Bahçelievler, Bağlarbaşı, Kartal, Beyazıt, Anadolu Hisarı, Nişantaşı, Acıbadem, Sultanahmet, Başıbüyük Sağlık, Şişli Kampüsler\'nde konumlanmıştır.70.000 öğrencinin öğrenim gördüğü üniversitenin 16 fakülte, 11 enstitü, 5 yüksekokul, 4 meslek yüksekokulu ve 19 araştırma ve uygulama merkezinde 3.000’e yakın öğretim elemanı görev almaktadır.', 'marmara-universitesi', '29.0525022', '40.9849312', 'İstanbul', null, '/m/02xq7h'), ('93', 'Mehmet Akif Ersoy Üniversitesi', 'Mehmet Akif Ersoy Üniversitesi Rektörlüğü İstiklal Yerleşkesi 15030 BURDUR', 'http://mehmetakif.edu.tr/images/logo-s.jpg', 'http://www.mehmetakif.edu.tr/', '', 'mehmet-akif-ersoy-universitesi', '30.3441846', '37.6906957', 'Burdur', null, '/m/0wkpgw4'), ('94', 'Mersin Üniversitesi', 'Çiftlikköy Kampusu 33343 Yenisehir / Mersin', 'http://www.mersin.edu.tr/img/uniLogoTR.png', 'http://www.mersin.edu.tr/', 'Mersin Üniversitesi 3 Temmuz 1992\'de “Bilimin ve çağdaşlığın ışığında bir dünya üniversitesi” vizyonuyla Mersin\'de devlet üniversitesi statüsünde kurulmuştur. Üniversitenin merkez yerleşkesi Çiftlikköy yerleşkesidir. 40.587 öğrencinin öğrenim gördüğü 15 fakülte, 5 enstitü, 8 yüksekokul, 12 meslek yüksekokulu, 24 araştırma ve uygulama merkezinde 1.652 akademik personel görev almaktadır.', 'mersin-universitesi', '34.5320517', '36.7800361', 'Mersin', null, '/m/051wz9j'), ('95', 'Mimar Sinan Güzel Sanatlar Üniversitesi', 'Kılıçali Paşa, 34433 İstanbul, Türkiye', 'http://emregozcu.com/uploads/images/8hivpl20151113205420.jpg', 'http://www.msgsu.edu.tr', '1882\' de Osman Hamdi Bey tarafından kurulan Sanayi-i Nefise Mektebi, 2003 yıkında Mimar Sinan Güzel Sanatlar Üniversitesi olarak bugünkü adını almıştır. İstanbul il sınırlarından devlet üniversitesi statüsünde eğitm veren üniversite, Fındıklı, Bomonti, Dolmabahçe (Konservatuar), Balmumcu (Sinema-Tv), Salıpazarı (Geleneksel El Sanatları) yerleşkelerinde konumlanmıştır. 8952 öğrencinin öğrenim gördüğü güzel sanatlar fakültesi, mimarlık fakültesi, fen edebiyat fakültesi, devlet konservatuvarı, güzel sanatlar enstitüsü, fen bilimleri enstitüsü, sosyal bilimler enstitüsü, iki meslek yüksek okulu ve bir yüksekokulda 625 akademik personel yer almaktadır.', 'mimar-sinan-guzel-sanatlar-universitesi', '28.9890969', '41.0294464', 'İstanbul', null, '/m/027dr0l'), ('96', 'Muğla Sıtkı Koçman Üniversitesi', 'Muğla Sıtkı Koçman Üniversitesi, 48000 Kötekli/Muğla ', 'http://www.mu.edu.tr/Icerik/Sayfa/bidb.mu.edu.tr/logo1.png', 'http://www.mu.edu.tr', 'Muğla Sıtkı Koçman Üniversitesi 03 Temmuz 1992 tarihinde devlet üniversitesi statüsünde Muğla\'da uluslararası standartlarda gerçekleştirdiği eğitim-öğretim, araştırma ve uygulamalarıyla insanlığa hizmetler sunan, bu hizmetlerin toplumsal refaha dönüştürülmesine öncülük eden bir dünya üniversitesi olma vizyonuyla kurulmuştur. Üniversitede 18 fakülte, 4 enstitü, 4 yüksekokul, 13 meslek yüksekokulu, 35 uygulama ve araştırma merkezi bulunmakta; 307 bölüm/program, 77 ana bilim dalında 1.426 öğretim elemanı ve 855 idari personel ile eğitim-öğretim hizmeti verilmektedir.Üniversitede 14.206 önlisans, 19.892 lisans, 2.494 lisansüstü olmak üzere toplam 36.592 öğrenci öğrenim görmektedir. Üniversitenin kuruluşundan bu yana mezun sayısı 59.594’tür. Ayrıca 2014-2015 Eğitim-Öğretim yılı itibari ile 49 farklı ülkeden toplam 522 uluslararası öğrenci öğrenim görmektedir. Üniversite öğrencilerinin barınma ihtiyaçlarına yönelik taleplerine, merkezde 2.152 yatak kapasiteli Yurt‐Kur Milli Piyango Kız Öğrenci Yurdu ile 1.800 yatak kapasiteli Yurt – Kur Muğla Erkek Öğrenci Yurdu; ilçelerde 324 yatak kapasiteli Ortaca Öğrenci Yurdu ve 300 yatak kapasiteli Fethiye Sıtkı Mefharet Koçman Öğrenci Yurdu ile cevap verilmektedir. Aynı zamanda üniversite kampüs alanında yer alan 1.250 kişi kapasiteli Residorm öğrenci yurdu Yap‐ İşlet‐Devret modeliyle tesis edilmiş olup hizmet vermektedir.', 'mugla-stk-kocman-universitesi', '28.373845', '37.164345', 'Muğla', null, '/m/0266dhp');
INSERT INTO `university` VALUES ('97', 'Muş Alparslan Üniversitesi', 'Muş Alparslan Üniversitesi Kampusu, Rektörlük, Diyarbakır Yolu 7. km 49250- MUŞ', 'http://www.alparslan.edu.tr/SayfaDosya?link=02b43cf2ca6c7672a9e6a8f94bc942fed0d46d80&pfdrid_c=true', 'http://www.alparslan.edu.tr/', 'Muş Alparslan Üniversitesi 29 Mayıs 2007 tarihinde yüksek kalitede eğitim-öğretim ve bilimsel araştırma olanakları sunma ve yaşanılan topluma açık olma ilkesiyle; teknolojiyi kullanan, bilimsel düşünen, araştıran, sorgulayan, toplum sorunlarına duyarlı, üreten, ülkemiz değerlerine ve insana saygılı, ülke kalkınmasına hizmet edebilecek mesleki bilgi ve becerilere sahip etkin bireyler yetiştirmeyi misyon edinerek Muş il sınırları içerisinde devlet üniversitesi statüsüyle kurulmuştur. Üniversite Diyarbakır yolu 7.km\'de bulunan merkez yerleşkesinde konumlanmıştır. Bunun dışında üniversitenin Malazgirt ve Karaköprü\'de de yerleşkeleri bulunmaktadır. 5700 lisans 3245 ön lisans ve 200 doktora öğrencisinin öğrenim gördüğü üniversitenin 6 fakülte 2 enstitü, 1 yüksekokul, 3 meslek yüksekokulu\'nda 464 akademik personel görev almaktadır.', 'mus-alparslan-universitesi', '41.4233923', '38.7719525', 'Muş', null, null), ('98', 'Mustafa Kemal Üniversitesi', 'Tayfur Sökmen Kampüsü (31001) Alahan-Antakya/HATAY', 'http://www.freelogovectors.net/wp-content/uploads/2012/06/hatay_mustafa_kemal_universitesi_logo.jpg', 'http://www.mku.edu.tr', 'Mustafa Kemal Üniversitesi, 10.11.1992 tarihinde Hatay il sınırları içerisinde devlet üniversitesi statüsünde kurulmuştur.Tayfur Sökmen Kampüsü\'nün merkez kampüs olduğu üniversitenin ek olarak, Altınözü MYO, Antakya MYO, Araştırma ve Uygulama Hastanesi, Hatay Sağlık YO, Kırıkhan MYO, Reyhanlı MYO, Sanat Tasarım MYO Turizm ve Otelcilik MYO,Yayladağı MYO kampüsleri bulunmaktadır. 32.554 öğrencinin öğrenim gördüğü üniversitenin 3 enstitü, 14 fakülte, 6 yüksekokul, 18 meslek yüksekokulu, 1 devlet konservatuvarı, 1 araştırma uygulama hastanesi ve 20 araştırma uygulama merkezinde 1115 akademik personel ve 721 idari personel görev almaktadır.', 'mustafa-kemal-universitesi', null, null, 'Hatay', null, '/m/0gj9v4f'), ('99', 'Nahcivan Devlet Üniversitesi', '', null, 'http://www.ndu.edu.az/', '', 'nahcivan-devlet-universitesi', null, null, 'Nahcivan (Azerbaycan)', null, null), ('100', 'Namık Kemal Üniversitesi', 'Namık Kemal Mahallesi Kampüs Caddesi Merkez/Tekirdağ', 'http://logovector.org/wp-content/uploads/logos/png/n/namik_kemal_universitesi_logo.png', 'http://www.nku.edu.tr', 'Namık Kemal Üniversitesi 17 Mart 2006 tarihinde uluslararası standartlarda eğitim-öğretim hizmeti vererek, araştırmacı ve yenilikçi anlayışıyla sürekli gelişen bir dünya üniversitesi olma vizyonuyla Tekirdağ\'da devlet üniversitesi statüsünde kurulmuştur. Üniversitenin merkez kampüsü Değirmenaltı kampüsüdür. 26.500 öğrencinin öğrenim gördüğü 8 Fakülte, 1 Konservatuvar, 3 Enstitü, 3 Yüksekokul, 11 Meslek Yüksekokulu, 10 Uygulama ve Araştırma Merkezi ve 5 Bölüm Başkanlığı\'nda 1.324 akademik ve idari personel bulunmaktadır.', 'namk-kemal-universitesi', '27.5820928', '40.9927858', 'Tekirdağ', null, '/m/0cpbvt1'), ('101', 'Necmettin Erbakan Üniversitesi', 'Necmettin Erbakan Üniversitesi Rektörlüğü Nişantaşı Mah. Dr. Hulusi Baybal Cad. No:12 Kat:25 Posta Kodu:42060 Selçuklu / KONYA', 'http://akademikduyuru.com/wp-content/uploads/2016/06/Necmettin-Erbakan-%C3%9Cni-Logo.png', 'http://www.konya.edu.tr', 'Necmettin Erbakan Üniversitesi 14.07.2010\'da katılımcı, farklılıklara saygılı ve özgürlükçü bir kurum kültürü içinde tüm paydaşlarımızın gereksinimlerine duyarlı olma prensibini esas alarak, araştırma ve eğitim alanındaki yenilikçi ve yol gösterici üslubu ile öncülüğe yol açan, özgün bilginin ortaya çıkarılmasını ve yayılmasını sağlayan, uluslararası bir referans noktası olma vizyonuyla Konya\'da devlet üniversitesi statüsünde kurulmuştur. 27361 öğrencinin öğrenim gördüğü 14 fakülte, 5 yüksekokul, 4 enstitü, 6 koordinatörlük ve 13 araştırma merkezinde 1.150 idari personel ve 1.459 akademik personel görev almaktadır.', 'necmettin-erbakan-universitesi', null, null, 'Konya', null, '/g/1hb_gpz0r'), ('102', 'Nevşehir Hacı Bektaş Veli Üniversitesi', '2000 Evler, Nevşehir Fakülte Yolu, 50300 Nevşehir Merkez/Nevşehir, Türkiye', 'http://dosyalar.nevsehir.edu.tr/7c0b4dafdc489938bd8b87b3bc0e2661_t/5x5cm_jpeg.jpg', 'http://www.nevsehir.edu.tr/', 'Nevşehir Hacı Bektaş Veli Üniversitesi 2007 yılında Dünyanın kültürel ve doğal miraslarından biri olan Kapadokya Bölgesinde eğitim, araştırma ve entelektüel liderliğiyle turizm, ekonomi, sanat ve teknoloji alanlarında topluma hizmet sunarak yerelden kopmadan evrensel değerlere katkıda bulunan öncü bir üniversite olma vizyonuyla devlet üniversitesi statüsünde Nevşehir\'de kurulmuştur. Üniversitenin merkez yerleşkesi Nevşehir\'de bulunmaktadır. Bunun dışında üniversite Avanos, Derinkuyu, Gülşehir, Hacıbektaş, Kozaklı, Ürgüp ilçelerinde bulunan yerleşkelerinde de eğitim vermektedir. 14609 öğrencinin öğrenim gördüğü üniversite bünyesinde bulunan 7 fakülte, 2 yüksekokul, 6 meslek yüksekokulu ve 7 araştırma merkezinde 575 akademik personel çalışmalarını yürütmektedir.', 'nevsehir-hac-bektas-veli-universitesi', null, null, 'Nevşehir', null, '/m/0j7m692'), ('103', 'Niğde Üniversitesi', 'Niğde Üniversitesi Rektörlüğü, Merkez Yerleşke, Bor Yolu Üzeri, Niğde, 51240', 'http://medya.nigde.edu.tr/uniweb/media/sayfa/logo/Nigdeuniversitesi.jpg', 'http://www.nigde.edu.tr/', 'Niğde Üniversitesi Bilim ve teknoloji alanlarında rekabet gücüne sahip bir üniversite olma vizyonuyla Niğde\'de devlet üniversitesi olarak kurulmuştur. Merkez yerleşkesinin Bor Yolu üzerinde konumlandığı, 23.900 öğrencinin öğrenim gördüğü 9 fakülte, 3 enstitü, 3 yüksekokul, 6 meslek yüksekokulu, 1 devlet konservatuvarı, rektörlüğe bağlı 4 bölüm başkanlığı, 1 kariyer geliştirme merkezi, 9 araştırma ve uygulama merkezi ve1 sürekli eğitim merkezinde 830 akademik personel görev almaktadır.', 'nigde-universitesi', '34.623765', '37.9420419', 'Niğde', null, '/m/0g9wyq8'), ('104', 'Ondokuz Mayıs Üniversitesi', 'Ondokuz Mayıs Üniversitesi Rektörlük Binası, Kurupelit Kampüsü, 55139 Atakum / SAMSUN', 'http://www.freelogovectors.net/wp-content/uploads/2012/06/ondokuzmayis_universitesi-logo.jpg', 'http://www.omu.edu.tr/', 'On Dokuz Mayıs Üniversitesi 1975 yılında Samsun\'da bilim ve teknolojide yeniliğin, eğitim ve öğretimde niteliğin, hizmette paydaş memnuniyetinin üst düzeyde olduğu, özenilen bir üniversite olma vizyonuyla devlet üniversitesi olarak kurulmuştur. Kurupelit Kampüsü\'nün merkez yerleşke olduğu üniversitenin, Güzel Sanatlar Kampüsü, M.K. G.doğdu Kampüsü, Bafra Kampüsü, Ballıca Kampüsü olmak üzere toplam 5 kampüsü bulunmaktadır. 52.300 öğrencinin öğrenim gördüğü üniversitenin 6 fakülte, 3 yüksekokul, 11 meslek yüksekokulu, 5 enstitü, 1 konservatuvar ve 23 uygulama araştırma merkezinde 2.295 akademik personel görev almaktadır.', 'ondokuz-mays-universitesi', '36.2221696', '41.3739733', 'Samsun', null, '/m/02vptrv'), ('105', 'Ordu Üniversitesi', 'Cumhuriyet Yerleşkesi PK 52200 Merkez / ORDU', 'http://www.odu.edu.tr/dist/images/logo2.png', 'http://www.odu.edu.tr', 'Ordu Üniversitesi eğitim-öğretim, araştırma-geliştirme, bilimsel yayın ve uygulamada Dünya standartlarını yakalayan, ülkemizin ve bölgemizin sosyo-ekonomik, teknolojik ve kültürel gelişimine katkıda bulunacak projeler üreterek paydaşlarıyla bütünleşen yenilikçi, rekabetçi, girişimci ve tercih edilen bir üniversite olma vizyonuyla 17 Mart 2006\'da Ordu\'da devlet üniversitesi statüsünde kurulmuştur. Cumhuriyet Yerleşkesi\'nin merkez yerleşkesi olduğu üniversitenin çevre ilçelerde meslek yüksekokulu yerleşkeleri bulunmaktadır. 19000 öğrencinin öğrenim gördüğü üniversitenin 10 fakülte, 10 meslek yüksekokulu, 3 yüksekokul ve 3 enstitü 5 araştırma ve uygulama merkezinde 645 akademik, 335 de idari personel bulunmaktadır.', 'ordu-universitesi', '37.9687272', '40.9756669', 'Ordu', null, '/m/0h_d36h'), ('106', 'Orta Doğu Teknik Üniversitesi', 'Orta Doğu Teknik Üniversitesi, Üniversiteler Mahallesi, Dumlupınar Bulvarı No:1, 06800 Çankaya Ankara/TÜRKİYE', 'http://www.metu.edu.tr/system/files/logo_orj/4/4.4.jpg', 'http://www.odtu.edu.tr', 'Orta Doğu Teknik Üniversitesi, Türkiye ve Orta Doğu ülkelerinin kalkınmalarına katkıda bulunmak, özellikle fen bilimleri ve sosyal bilimler alanlarında eleman yetiştirmek üzere 15 Kasım 1956 tarihinde \"Orta Doğu Yüksek Teknoloji Enstitüsü\" adıyla devlet üniversitesi statüsünde eğitime başlamıştır. İçel-Erdemli\'de bulunan Deniz Bilimleri Enstitüsü ve Kuzey Kıbrıs Kampüsü dışında üniversitenin bütün fakülteleri ve bölümleri, Ankara\'da bulunan merkez yerleşkede bulunmaktadır. 28.000\'den fazla öğrencinin öğrenim gördüğü 3\'ü uluslararası ortak program olmak üzere 43 lisans programının yürütüldüğü 5 Fakülte, 107 yüksek lisans ve 69 doktora programının yürütüldüğü 5 Enstitü, İngilizce eğitimi veren Yabancı Diller Yüksek Okulu, ODTÜ Kuzey Kıbrıs Kampüsü\'ne bağlı 15 lisans programı ve 3 yüksek lisans programında 1.115 öğretim üyesi (Prof., Doç., Yrd.Doç.), 324 öğretim görevlisi, 1.259 araştırma görevlisi görev almaktadır.', 'orta-dogu-teknik-universitesi', '32.7842265', '39.894891', 'Ankara', null, '/m/02kj58'), ('107', 'Osmaniye Korkut Ata Üniversitesi', 'Osmaniye Korkut Ata Üniversitesi 80000 Fakıuşağı / OSMANİYE ', 'http://www.osmaniye.edu.tr/oku_logo/logo_250.png', 'http://www.osmaniye.edu.tr', 'Osmaniye Korkut Ata Üniversitesi 29 Mayıs 2007 tarihinde nitelikli insan kaynaklarımızla üniversite-sanayi-toplum iş birliğini sürekli hale getirerek, uluslararası düzeyde rekabet edebilen önder bir üniversite olma vizyonuyla Osmaniye\'de devlet üniversitesi statüsünde kurulmuştur. Üniversitesi Merkez Karacaoğlan Yerleşkesi’nde ve Osmaniye ilçelerinde bulunan Meslek Yüksekokullarında 5 fakülte 4 meslek yüksekokulu, 3 yüksekokul, 2 enstitüsü, 8967 öğrencisi ve 379 akademik personeli ile eğitim-öğretim faaliyetlerini sürdürmektedir.', 'osmaniye-korkut-ata-universitesi', '36.2223419', '37.0399', 'Osmaniye', null, '/g/120s_7jv'), ('108', 'Pamukkale Üniversitesi', 'Kınıklı Kampüsü / Denizli', 'http://rekabetekonomisi.pamukkale.edu.tr/images/pau_logo.gif', 'http://www.pau.edu.tr/', 'Pamukkale Üniversitesi 1992 yılında tıp, mühendislik, iktisadi bilimler, fen bilimleri, sosyal bilimler, güzel sanatlar, eğitim bilimleri ve teknik eğitim gibi birbirinden farklı alanlarda Türkiye’nin ve Dünya\'nın ihtiyaç duyduğu çağdaş, bilgili, yaratıcı, girişimci genç beyinleri yetiştirme vizyonuyla devlet üniversitesi statüsünde Denizli\'de kurulmuştur. Pamukkale Üniversitesi, bugün 14 fakülte, 5 enstitü, 4 yüksekokul ve 12 meslek yüksekokulunda Ağustos 2015 itibari ile 52148 öğrenci, 1988’i akademik olmak üzere toplam 5540 çalışanıyla Kınıklı Kampüsündeki tüm fakülte ve sosyal tesisleri ve ilçelerde bulunan mekanları ile modern eğitim-öğretim ve hizmet ortamlarını oluşturan Pamukkale Üniversitesi, uluslararası araştırma üniversitesi olma hedefine kararlı ve hızlı adımlarla ilerlemektedir.', 'pamukkale-universitesi', null, null, 'Denizli', null, '/m/0622h4'), ('109', 'Recep Tayyip Erdoğan Üniversitesi', 'Recep Tayyip Erdogan Üniversitesi Zihni Derin Yerleşkesi - Fener Mahallesi 53100 Merkez/RİZE', 'http://i.radikal.com.tr/644x385/2012/05/16/fft5_mf982731.Jpeg', 'http://www.erdogan.edu.tr', '1 Nisan 2012 tarihinde Recep Tayyip Erdoğan Üniversitesi adını alan Rize Üniversitesi olarak 7 Mart 2006 tarihinde, bilim ve teknolojik alanda rekabet gücüne sahip, evrensel düzeyde eğitim-öğretim veren, ulusal ve uluslararası düzeyde öğrenciler tarafından tercih edilen, sağlık ve mühendislik alanındaki özgün araştırmalarıyla tanınan, saygın bir üniversite olma vizyonuyla Rize\'de devlet üniversitesi statüsünde kurulmuştur. Zihni Derin Yerleşkesi\'nin merkez yerleşke olduğu, 16.140 öğrencinin öğrenim gördüğü 3 enstitü, 12 fakülte, 6 yüksekokul, 7 meslek yüksekokulu, 7 araştırma ve uygulama merkezi ve rektörlüğe bağlı 6 bölüme sahip üniversitede 925 akademik personel görev almaktadır.', 'recep-tayyip-erdogan-universitesi', '40.4944986', '41.0369382', 'Rize', null, '/m/0qsc9zd'), ('110', 'Sakarya Üniversitesi', 'Sakarya Üniversitesi Esentepe Kampüsü 54187 Serdivan / SAKARYA', 'http://akademikduyuru.com/wp-content/uploads/2016/06/sakarya-university.png', 'http://www.sau.edu.tr', 'Sakarya Üniversitesi 3 Temmuz 1992 tarihinde, ürettiği evrensel nitelikte bilgi ve teknoloji ile Türkiye ve Dünya\'da paydaşlarının geleceğine yön veren bir üniversite olma vizyonuyla Sakarya\'da kurulmuştur. Merkez yerleşkesinin Serdivan ilçesinde konumlanan Esentepe Kampüsü olduğu, 84024 öğrencinin öğrenim gördüğü 5 enstitü, 16 fakülte, 5 yüksekokul, 15 meslek yüksekokulu, 33 araştırma merkezi ve 1 teknokente sahip üniversitede 2424 öğretim elemanı görev almaktadır', 'sakarya-universitesi', '30.3405147', '40.7441916', 'Sakarya', null, '/m/025xyrp'), ('111', 'Selçuk Üniversitesi', 'Selçuk Üniversitesi Rektörlüğü, Şemsi Tebrizi Mah. Ankara Cad. No:6 Posta Kodu:42030 Karatay-Konya', 'http://www.selcuk.edu.tr/dosyalar/files/323/9_Sel%C3%A7uk-Amblem-logo.png', 'http://www.selcuk.edu.tr/', 'Selçuk Üniversitesi 1975 yılında Dünya çapında üniversite olmayı amaçlayan, öğrencilerin tercih ettiği ve mezunları tercih edilen, sürekli değişimi hedefleyen bir üniversite olma amacıyla Konya\'da devlet üniversitesi statüsünde kurulmuştur. Üniversitenin merkez yerleşkesi Konya\'nın Selçuklu ilçesinde bulunan Alaeddin Keykubat Kampüsü\'dür. 79.395 öğrencinin öğrenim gördüğü üniversitenin bünyesinde bulunan 23 fakülte, 6 enstitü, 5 yüksekokulda 2 bin 683 akademik personel görev almaktadır.', 'selcuk-universitesi', '32.512798', '38.0163717', 'Konya', null, '/m/02q0pm2'), ('112', 'Siirt Üniversitesi', 'Güres Caddesi 56100 Siirt/Türkiye ', 'http://d.haberciniz.biz/other/siirt-universitesinin-amblemi-degisti-01.jpg', 'http://www.siirt.edu.tr/', '', 'siirt-universitesi', null, null, 'Siirt', null, '/m/0r8lpgb'), ('113', 'Sinop Üniversitesi', 'Korucuk Köyü Trafo Mahallesi No:36 57000-SİNOP', 'http://basinyayin.sinop.edu.tr/images/logo/logo.jpg', 'http://www.sinop.edu.tr ', 'Sinop Üniversitesi 2007 yılında Bilgi toplumunun oluşmasına katkı sağlayan bir dünya üniversitesi olma vizyonuyla Sinop\'ta devlet üniversitesi statüsü ile kurulmuştur. 5677 öğrencinin öğrenim gördüğü 8 fakülte , 2 yüksekokul , 2 enstitü , 5 meslek yüksekokulu ve 10 araştırma uygulama merkezinde Sinop Üniversitesi kendi değerlerinden aldığı güç ve sürekli gelişim, yenilenme arayışı ile geleceğe odaklanmış bireyler yetiştirerek bölgesine ve ülkesine katkı sağlama misyonuyla eğitim öğretim faaliyetlerini 426 akademik personeli ile sürdürmektedir.', 'sinop-universitesi', '35.0902111', '42.0056806', 'Sinop', null, '/g/12168nwj'), ('114', 'Şota Rustaveli Devlet Üniversitesi', '', 'http://www.hangiuniversite.com/resimler/universiteler/422.png', 'http://www.bsu.edu.ge/', '', 'sota-rustaveli-devlet-universitesi', null, null, 'Batum (Gürcistan)', null, null), ('115', 'Şırnak Üniversitesi', 'ŞIRNAK ÜNİVERSİTESİ Cumhuriyet Mahallesi Atatürk Caddesi 73000 Şırnak - Türkiye', 'http://www.sirnak.edu.tr/resimler/images/logo800x571.jpg?phpMyAdmin=dd7d1a81162a2c8bfbed1c7bf88976cb', 'http://www.sirnak.edu.tr', 'Şırnak Üniversitesi 22 Mayıs 2008 tarihinde Ulusal ve bölgesel sorunların çözümüne odaklı, yenilikçi, kalite anlayışını benimsemiş saygın bir üniversite olma vizyonuyla devlet üniversitesi statüsüyle Şırnak\'ta kurulmuştur. 3522 öğrencinin öğrenim üniversitenin bünyesinde bulunan 4 fakülte, 1 enstitü, 2 yüksekokul, 4 yüksekokulda Şırnak Üniversitesi, evrensel bakış açısıyla bilgi ve teknoloji üretmek; ürettiği bilgi ve teknolojiyi bölgenin ve ülkenin kalkınması yararına kullanmak; ulusal ve uluslararası işbirliği ve dayanışma anlayışıyla toplumun yaşam kalitesinin yükseltilmesine yönelik eğitim ve araştırma faaliyetlerine öncülük etmek; ülkenin ihtiyaç duyduğu araştırmacı, paylaşımcı, sorgulayıcı, çözümleyici, girişimci, yaşam boyu öğrenmeyi benimsemiş, kültürlü ve estetik değerlere sahip bireyler yetiştirme misyonuyla eğitim ve öğretim faaliyetlerine 272 akademik personel ile devam etmektedir.', 'srnak-universitesi', null, null, 'Şırnak', null, '/g/120trzgp'), ('116', 'Süleyman Demirel Üniversitesi', 'Süleyman Demirel Üniversitesi, 32260 Çünür/ISPARTA', 'http://w3.sdu.edu.tr/kurumsal/sdu_logo.jpg', 'http://www.sdu.edu.tr/', 'Süleyman Demirel Üniversitesi 1992 yılında Isparta\'da eğitim-öğretim, bilim ve araştırmada kaliteden ödün vermeden emin adımlarla geleceğe yürüyerek, bilimsel çalışmalarıyla dünyaya şekil vererek, içinde bulunulan yörenin toplumsal değerlerine saygılı, yereli iyi bilen, ülke sorunlarına duyarlı, bölgesinde lider, bununla birlikte bir Dünya üniversitesi olarak gelişmesini sürdürme vizyonuyla kurulan bir devlet üniversitesidir. Üniversite binalarının büyük bir kısmı Isparta’daki merkez yerleşkededir. Süleyman Demirel Üniversitesi; 19 fakülte, 3 yüksekokul, 20 meslek yüksekokulu, 6 enstitü ile 46 araştırma ve uygulama merkezine ve burada öğrenim gören 55.293 öğrenciye sahip olup modern eğitim olanakları ve güçlü akademik kadrosuyla öğrencilerine kucak açan, öğrencilerinin çeşitli meslek dallarında en iyi eğitimi almalarını amaç edinmiştir.', 'suleyman-demirel-universitesi', '30.5295082', '37.8324966', 'Isparta', null, '/m/0f04kj'), ('117', 'Sumgayıt Devlet Üniversitesi', '', null, 'http://sdu.edu.az/', '', 'sumgayt-devlet-universitesi', null, null, 'Sumgayıt (Azerbaycan)', null, '/m/0cnfvr'), ('118', 'Trakya Üniversitesi', 'Trakya Üniversitesi Rektörlüğü, 22030 Balkan Yerleşkesi / EDİRNE', 'http://seeklogo.com/images/T/Trakya___niversitesi-logo-C6F86146CF-seeklogo.com.gif', 'http://www.trakya.edu.tr/', 'Trakya Üniversitesi 1982 yılında bilim ve eğitim dünyasında küresel ölçekte etkin, tanınan, izlenen ve tercih edilen bir üniversite olma vizyonuyla Edirne\'de kurulan vir devlet üniversitesidir. Üniversite Balkan yerleşkesi başta olmak üzere 6 yerleşkede (Ayşekadın Yerleşkesi, Prof. Dr. Ahmet Karadeniz Yerleşkesi, Kosova Yerleşkesi, Selimiye Yerleşkesi, Sarayiçi Yerleşkesi, Makedonya Yerleşkesi ) konumlanmıştır. 39696 öğrencinin öğrenim gördüğü 12 Fakülte 5 Enstitü 6 Yüksekokul 10 Meslek Yüksekokulu 1 devlet konservatuvarında Trakya Üniversitesi 1646 akademik personeli ile araştırma, eğitim ve öğretim faaliyetini, bilimsel ve kültürel mirası değerlendirip çağın gerçeklerini görerek geleceği kurma ilkesiyle yürütmek; bilgi ve becerilerini Edirne, Balkanlar, ülke ve insanlık yararına kullanma bilincine sahip, özgüven ve sorumluluk duygusu yüksek bireyler yetiştirme misyonuyla faaliyetlerini sürdürmektedir.', 'trakya-universitesi', '26.613113', '41.637027', 'Edirne', null, '/m/03chg1r'), ('119', 'Tunceli Üniversitesi', 'Aktuluk Kampüsü Merkez/TUNCELİ PK:62000', 'http://www.tunceli.edu.tr/idari/personeldb/images/tuncelilogo.png', 'http://www.tunceli.edu.tr', 'Tunceli Üniversitesi, 22 Mayıs 2008 tarihinde Yenilikçi, dinamik ve katılımcı yapısıyla, bölgemizde eksikliği hissedilen girişimcilik ruhunu canlandırabilecek Ar-Ge faaliyetleriyle, bölgesindeki insanî ve sosyal sorunlara çözüm üreten, ülkemizin doğu ve güneydoğu komşularıyla mevcut ilişkileri geliştiren, eğitim-öğretim, araştırma ve geliştirme yapan, yerelde etkin başarıya sahip teknoloji odaklı bir dünya üniversitesi olarak ilerleme vizyonuyla Tunceli\'de kurulan bir devlet üniversitesidir. Üniversite Tunceli Merkez, Pertek, Pülümür, Hozat, Nazımiye, Mazgirt, Ovacık\'ta bullunan yerleşkelerinde konumlanmıştır. Tunceli Üniversitesi, 7063 öğrencinin öğrenim gördüğü üniversitenin 2 enstitü, 7 araştırma merkezi, 6 fakülte, 1 yüksekokul, 8 meslek yüksekokulunda 418 akademik personel Munzur’dan yükselen bilim güneşi sloganıyla eğitim öğretim faaliyetlerini sürdürmektedir.', 'tunceli-universitesi', null, null, 'Tunceli', null, null), ('120', 'Türk-alman Üniversitesi', 'Şahinkaya Cad. 86 - 34820 Beykoz / İSTANBUL', 'http://www.tuerkei.diplo.de/contentblob/4354244/Galeriebild_gross/4773472/logotdu.jpg', 'http://www.tau.edu.tr/', 'Türk-Alman Üniversitesi (TAÜ), Türkiye Cumhuriyeti ile Almanya Federal Cumhuriyeti arasında imzalanan anlaşmaya dayanarak kurulan bir devlet üniversitesidir. TAÜ\'nün yerleşkesi Beykoz ilçe sınırlarında bulunmaktadır. Kendisini akademik sınıflamada bir araştırma üniversitesi olarak tanımlayan 311 öğrencinin öğrenim gördüğü üniversitenin bünyesinde 5 fakülte, 2 enstitü ve 1 yabancı diller yüksekokulu bulunmaktadır. Bu birimlerde 72 akademik personel görev almaktadır.', 'turk-alman-universitesi', null, null, 'İstanbul', null, '/g/1226lvhl'), ('121', 'Uludağ Üniversitesi', 'Görükle Kampusu 16059 Nilüfer/BURSA', 'http://onerimerkezi.uludag.edu.tr/resim/jpgversiyonu.jpg', 'http://www.uludag.edu.tr/', 'Uludağ Üniversitesi 1975 yılında aklın ve bilimin öncülük ettiği, Atatürk\'ün çizdiği çağdaş, laik ve demokratik yolda, özgür düşünceli ve kişisel sorumluluk duyguları gelişmiş ulusal değerlere saygılı olarak kültürel ve tarihi değerleri benimsemiş, çağdaş görünüşlü gençler yetiştirmeyi amaç edinerek Bursa il sınırları içerisinde bir devlet üniversitesi olarak kurulmuştur. Üniversite merkez yerleşke olan Görükle, Gemlik Sunğipek-Asım Kocabıyık Yerleşkesi, Ali Osman Sönmez Kampusu, Mudanya, Mustafakemalpaşa, Karacabey, İnegöl, İznik, Yenişehir İbrahim Orhan, Orhangazi, Orhaneli, Keles, Harmancık ve Büyükorhan\'da konumlanmıştır. Üniversite bünyesinde bulunan 13 Fakülte, 3 Yüksekokul, 15 Meslek Yüksekokulu, 1 Konservatuvar, 4 Enstitü, 18 Uygulama ve Araştırma Merkezi ile 2 Araştırma Merkezi ve Rektörlüğe bağlı olarak kurulan 5 bölümde 60.000 öğrenci öğrenim görmektedir.', 'uludag-universitesi', '28.8667694', '40.2225309', 'Bursa', null, '/m/02z6_k6'), ('122', 'Uşak Üniversitesi', 'Ankara İzmir Yolu 8.Km 1.Eylül Kampüsü, Uşak/Merkez', 'http://www.logomuz.com/dosyalar/resim/usak-universitesi-1305533120.jpg', 'http://www.usak.edu.tr', 'Uşak Üniversitesi 17 Mart 2006 tarihinde Afyon Kocatepe Üniversitesi\'nden ayrılarak Uşak il sınırları içerisinde “Aklın ve Bilimin Işığında Saygın Bir Üniversite” sloganıyla bir devlet üniversitesi olarak kurulmuştur. 1 Eylül Kampüsü üniversitenin merkez kampüsüdür. Bunun dışında çevre ilçelerde üniversitenin meslek yüksekokulları konumlanmıştır. 22.145 öğrencinin öğrenim gördüğü üniversitenin 11 fakülte, 3 yüksekokul, 11 meslek yüksekokulu, 2 enstitü ve 21 araştırma ve uygulama merkezinde 1589 akademik personel görev almaktadır.', 'usak-universitesi', null, null, 'Uşak', null, '/m/0cp3pm9'), ('123', 'Yalova Üniversitesi', 'Yalova Üniversitesi Merkez Yerleşkesi, Çınarcık Yolu Üzeri 77200 Yalova', 'http://blog.yalova.edu.tr/ismailsavran/wp-content/uploads/sites/7/2013/07/Yalova-%C3%9Cni.-Yeni-Logo-3-430x300.jpg', 'http://www.yalova.edu.tr', 'Temelini Uludağ Üniversitesi Yalova Meslek Yüksek Okulu\'nun oluşturduğu Yalova Üniversitesi, 31 Mayıs 2008 tarihinde Dünya ile entegre olabilecek çağdaş donanımlara sahip bireyler yetiştirmeyi hedef edinerek Yalova\'da bir devlet üniversitesi olarak kurulmuştur. Çınarcık Yolu 2.Km\'de bulunan Merkez Yerleşkesi\'nde konumlanan üniversitenin çevre ilçelerde meslek yüksekokulu yerleşkeleri bulunmaktadır.11243 öğrencinin öğrenim gördüğü, üniversite bünyesinde bulunan 5 fakülte, 2 enstitü, 4 meslek yüksekokulu ve 1 yüksekokulda 497 akademik personel görev almaktadır.', 'yalova-universitesi', null, null, 'Yalova', null, '/m/076zj7r'), ('124', 'Yıldırım Beyazıt Üniversitesi', 'Çankırı Caddesi Çiçek Sokak No:3 Ulus-ALTINDAĞ / ANKARA', 'http://www.apartyurt.com/wp-content/uploads/2016/02/Y%C4%B1ld%C4%B1r%C4%B1m-Beyaz%C4%B1t-%C3%9Cniversitesi-LOGO.jpg', 'http://www.ybu.edu.tr', 'Yıldırım Beyazıt Üniversitesi Ankara\' nın 5. devlet üniversitesi olarak 03 ekim 2011 tarihinde devlet üniversitsi olarak Üniversite eğitiminde yeni bir soluk sloganı ile eğitim hayatına başlamıştır. Merkez yerleşkesi Ulus\'ta bulunan üniversitenin Etlik,Cinnah, Bilkent, Esenboğa, Keçiören\'de yerleşkeleri bulunmaktadır. 8 fakülte, 1 yüksekokul, 4 enstitü ve 1 konservatuvar ile öğretim yapan üniversitede 1018 akademisyen görev yapmakta 11319 öğrenci de üniversitede öğrenim görmektedir.', 'yldrm-beyazt-universitesi', null, null, 'Ankara', null, '/m/0r8kdtz'), ('125', 'Yıldız Teknik Üniversitesi', 'Barbaros Bulvarı, 34349 Yıldız-İstanbul', 'http://www.yildiz.edu.tr/images/files/ytulogopng.png', 'http://www.yildiz.edu.tr', 'Yıldız Teknik Üniversitesi, 1911 yılında eğitim, araştırma ve kültür ortamı ile tercih edilen bir dünya üniversitesi olma vizyonuyla İstanbul’da kurulmuş bir vakıf üniversitesidir. Üniversitenin merkez yerleşkesi, Yıldız Yerleşkesi\'dir. Bunun dışında üniversite Davutpaşa ve Ayazağa Kampüsleri\'nde de faaliyet göstermektedir. 34179 öğrencinin öğrenim gördüğü üniversitenin 10 fakülte, 2 enstitü, 2 meslek yüksekokulu ve yabancı diller yüksekokulunda 1756 öğrenci öğrenim görmektedir.', 'yldz-teknik-universitesi', '29.010297', '41.052244', 'İstanbul', null, '/m/09_vfv'), ('126', 'Yüzüncü Yıl Üniversitesi', 'Yüzüncü Yıl Üniversitesi Rektörlüğü, 65080, Kampüs / VAN', 'http://frmderin.com/wp-content/uploads/600px-Y%C3%BCz%C3%BCnc%C3%BC_y%C4%B1l_%C3%9Cniversitesi_logosu.jpg', 'http://www.yyu.edu.tr/', 'Yüzüncü Yıl Üniversitesi, 1982 yılında Van il sınırları içerisinde kurulmuş bir devlet üniversitesidir. Üniversite Van Gölü kenarında kurulmuş, şehir merkezine 15 km mesafede olan kampüsünde eğitim öğretim faaliyetlerini sürdürmektedir. 25.393 öğrencinin öğrenim gördüğü üniversitenin 14 fakülte, 4 enstitü, 11 yüksekokul ve 19 uygulama ve araştırma merkezinde 1657 akademik personel görev almaktadır.', 'yuzuncu-yl-universitesi', '43.291709', '38.5673875', 'Van', null, '/m/0276cz7'), ('127', 'Acıbadem Üniversitesi', 'Kerem Aydınlar Kampüsü, Kayışdağı Cad. No:32, 34752​ Ataşehir/İSTANBUL', 'http://www.basinbulteni.com/sirket_logos/acibadem_universitesi_logo.jpg', 'http://www.acibadem.edu.tr', '8 Mayıs 2007\'de kurulan Acıbadem Üniversitesi 4 fakülte, 2 enstitü, 2 meslek yüksekokulu ve 6 araştırma merkezi ile Ataşehir, İstanbul\'da 387 öğretim elemanı ile sağlık bilimleri alanında faaliyet gösteren vakıf üniversitesidir. 2009-2010 eğitim öğretim yılında da ilk öğrencilerini alarak eğitime başlayan üniversite 2010-2011 eğitim öğretim yılında ilk mezunlarını vermiştir. Acıbadem Üniversitesi\'nde 2325 öğrenci öğrenim görmektedir.', 'acbadem-universitesi', null, null, 'İstanbul', null, '/m/0cpdxrm'), ('128', 'Akdeniz Karpaz Üniversitesi', '', 'http://portal.akun.edu.tr:84/image/logo', 'http://www.akun.edu.tr/', '', 'akdeniz-karpaz-universitesi', null, null, 'Lefkoşa (KKTC)', null, '/g/1q678bmrn'), ('129', 'Alanya Hamdullah Emin Paşa Üniversitesi', 'Alanya Hamdullah Emin Paşa Üniversitesi, Cikcilli Mah. Saraybeleni Cad. No:7, 07400 Alanya/Antalya/Türkiye', 'http://www.egitimtercihi.com/image/Ayin_Dosyasi/alanyahepuni.jpg', 'http://www.ahep.edu.tr', 'Alanya Hamdullah Emin Paşa Üniversitesi, Hamdullah Emin Paşa ve Haremi Hatice Tahire Hanım Vakfı tarafından 3 Mart 2011 tarihinde Antalya\'ya bağlı olan Alanya ilçesinde Akdeniz tarih ve kültürünün kesiştiği Alanya`da; eğitim, araştırma ve topluma hizmet sunma sorumluluğuna sahip bir üniversite olma amacıyla kurulmuş bir vakıf üniversitesidir. Üniversite Nimet ve Abdurrahman Alaettinoğlu yerleşkelerinde konumlanmıştır. Tüm lisans programlarının %100 İngilizce olduğu üniversite bünyesinde 2 fakülte ve 1 yüksekokul bulunmaktadır.', 'alanya-hamdullah-emin-pasa-universitesi', null, null, 'Antalya', null, '/g/15dpmx5b'), ('130', 'Atılım Üniversitesi', 'Kızılcaşar Mahallesi, 06836 İncek Gölbaşı - Ankara - Türkiye', 'http://www.baharfestivalleri.com/wp-content/uploads/2015/01/Atilim-Universitesi.png', 'http://www.atilim.edu.tr', 'Atılım Üniversitesi, özgün bilimsel çalışmalarda adı olan, nitelikli ve yetkin bireyler yetiştiren, geleceğe iz bırakan bir üniversite olma vizyonu ile 15 Temmuz 1997 tarihinde Ankara\'da Atılım Vakfı tarafından bir vakıf üniversitesi olarak kurulmuştur. İncek Gölbaşı\'nda bulunan yerleşkesi Ankara merkeze 20 km uzaklıktadır. Bünyesinde bulunan 5 fakülte, 2 enstitü, 1 yüksekokul, 1 meslek yüksekokulu, 9 araştırma merkezi ve 601 akademik personeli, üniversitede öğrenim gören 8188 öğrencisine, toplumsal duyarlılık anlayışı içinde, bilimsel bilginin üretimi ve uygulanmasında performansı yüksek alanlar yaratarak, ulusal ve evrensel düzeyde donanıma sahip nitelikli bireyler yetiştirme misyonu ile eğitim öğretim vermektedir.', 'atlm-universitesi', '32.7233147', '39.8153966', 'İstanbul', null, '/m/065h3w'), ('131', 'Avrasya Üniversitesi', 'T.C. Avrasya Üniversitesi Rektörlüğü Adnan Kahveci Mahallesi Rize caddesi, No:226 TRABZON / TURKEY', 'http://avrasya.edu.tr/wp-content/uploads/2015/01/avrasya-universitesi-logo-1.png', 'http://www.avrasya.edu.tr', '', 'avrasya-universitesi', '39.8058634', '40.987894', 'Trabzon', null, '/m/012fy49p'), ('132', 'Bahçeşehir Üniversitesi', '', 'http://www.dgsli.org/wp-content/uploads/2014/08/Bah%C3%A7e%C5%9Fehir-%C3%9Cniversitesi_logo.jpg', 'http://www.bahcesehir.edu.tr', 'Bahçeşehir Üniversitesi, 1998 yılında Bahçeşehir-Uğur Eğitim Vakfı tarafından “İstanbul\'un Kalbinde Bir Dünya Üniversitesi” sloganıyla açılan bir vakıf üniversitesidir. Merkez kampüsünün Beşiktaş\'ta olduğu Bahçeşehir Üniversitesi\'nin İstanbul\'daki diğer kampüsleri Galata, Göztepe ve Şişli\'de bulunmaktadır. Bunun dışında Bahçeşehir Üniversitesi\'nin yurt dışında Berlin,Silikon Vadisi, Hong Kong, Köln, Batum ve Toronto’da olmak üzere toplam 6 kampüsü daha bulunmaktadır. 8 fakülte, 1 yüksekokul, 2 meslek yüksekokulu ve 14 araştırma merkezinin faaliyet gösterdiği Bahçeşehir Üniversitesi\'nde 1047 akademik personel, 506 idari personel görev almakta ve 17.048 öğrenci öğrenim görmektedir.', 'bahcesehir-universitesi', null, null, 'İstanbul', null, '/m/0bq1kt'), ('133', 'Başkent Üniversitesi', 'Bağlıca Kampüsü Eskişehir Yolu 20. km Bağlıca, 06810 ANKARA', 'http://logovector.org/wp-content/uploads/logos/png/b/baskent_universitesi_logo.png', 'http://www.baskent.edu.tr', '', 'baskent-universitesi', null, null, 'Ankara', null, '/m/02r7mgx'), ('134', 'Beykent Üniversitesi', 'Taksim Yerleşkesi, Sıraselviler, 34433 Beyoğlu/İstanbul, Türkiye', 'http://beykent.edu.tr/uploads/ckeditor/attachments/561ce2a76565730abf030000/BeykentLogo_ENG_RGB.png', 'http://www.beykent.edu.tr', 'Beykent Üniversitesi, 1997 yılında İstanbul\'da profesyonel yaşam için doğru seçim sloganıyla kurulmuş bir vakıf üniversitesidir. Ayazağa-Maslak, Beylikdüzü ve Taksim olmak üzere üç yerleşkede eğitim faaliyetlerini sürdüren üniversitenin bünyesinde 9 fakülte, 1 meslek yüksekokulu ve 2 enstitü bulunmaktadır. 500 öğretim üyesinin görev yaptığı bu birimlerde 25.000 öğrenci öğrenim görmektedir.', 'beykent-universitesi', '29.0040176', '41.1172697', 'İstanbul', null, '/m/03cc49z'), ('135', 'Bezm-i Âlem Vakıf Üniversitesi', 'Adnan Menderes Bulvarı Vatan Caddesi 34093 Fatih/İstanbul', 'http://www.ohder.org.tr/wp-content/uploads/2015/11/logo.png.jpg', 'http://www.bezmialem.edu.tr', 'Bezmi Alem Vakıf Üniversitesi, Bezm-i Alem Valide Sultan Vakıf Gureba tarafından 2010\'da vakıf üniversitesi statüsünde kurulmuştur. Sağlık bilimleri üzerine eğitim veren üniversitenin merkez yerleşkesi İstanbul\'un Fatih ilçesindedir. Yine aynı şehirde üniversitenin Gayrettepe kampüsü bulunmaktadır. Eğitimde örnek alınan, bilime yön veren, lider sağlık üniversitesi olma vizyonuyla hareket eden üniversite bünyesinde 4 fakülte, 1 meslek yüksekokulu, 4 enstitü, 2 kurul ve 2 araştırma merkezi bulunmaktadır. 2067 öğrencinin öğrenim gördüğü üniversitede 483 akademik personel çalışmalarını sürdürmektedir.', 'bezm-i-alem-vakf-universitesi', null, null, 'İstanbul', null, null), ('136', 'Biruni Üniversitesi', '10. Yıl Caddesi Protokol Yolu No: 45, 34010 Topkapı İstanbul', 'http://obs.biruni.edu.tr/files/university/images/logo.png', 'http://www.biruni.edu.tr/', 'Biruni Üniversitesi 27.02.2014 tarihinde İstanbul\'da kurulmuş bir vakıf üniversitesidir. Topkapı\'da bulunan kampüsünde kurulduğu günden bugüne eğitim, araştırma ve hizmetleri ile ülkemiz ve Dünya’da referans kabul edilen yenilikçi, girişimci lider bir sağlık üniversitesi olma vizyonuyla çalışmalarını sürdürmektedir. Bünyesinde bulunan 6 fakülte 3 enstitü, 1 meslek yüksek okulu ve 1 araştırma merkezinde sağlığın her alanında bilgi üreten ve uygulama sorumluluğu taşıyan, öğrenci odaklı, toplumun değer yargılarına ve farklılıklarına saygılı, dünya standartlarında eğitim ve hizmet verme misyonuyla 4 binden fazla öğrenciye eğitim-öğretim vermektedir.', 'biruni-universitesi', null, null, 'İstanbul', null, '/g/1q5jpwm52'), ('137', 'Çağ Üniversitesi', 'Adana-Mersin Karayolu Üzeri 33800 YENİCE- TARSUS / MERSİN', 'http://www.eniyivakifuniversiteleri.com/wp-content/uploads/2015/01/cag-logo.jpg', 'http://www.cag.edu.tr/', '', 'cag-universitesi', null, null, 'Mersin', null, '/m/0gywqg8'), ('138', 'Çankaya Üniversitesi', 'Eskişehir Yolu 29. Km, Yukarıyurtçu Mahallesi Mimar Sinan Caddesi No:4 06790, Etimesgut/ANKARA', 'http://www.tto.cankaya.edu.tr/wp-content/uploads/2015/05/Logo_of_%C3%87ankaya_University.png', 'http://www.cankaya.edu.tr/', 'Çankaya Üniversitesi, Sıtkı Alp Eğitim Vakfı tarafından Dünya standartlarında kaliteli yükseköğretim ve uluslararası yabancı dilde eğitim sağlayan; uluslararası düzeyde araştırma-geliştirme çalışmaları yapan ve bilgi üreten; topluma hizmeti temel görevleri arasında sayan; bilgi toplumunun oluşmasında türkiyemizde öncülük eden; Türkiye Cumhuriyeti’nin demokratik, laik ve sosyal hukuk devleti niteliklerine sahip çıkan; vatanını, milletini ve tüm insanları seven bireyler yetiştiren; üniversite-sanayi işbirliğine önem veren; toplumun her kesiminde saygı duyulan, bir üniversite olmak amacıyla 1997-1998 öğretim yılında Ankara\'da faaliyete geçmiştir.Biri Ankara Balgat\'ta diğeri Eskişehir yolu üzerinde iki kampüsü bulunan üniversitenin 5 fakülte, 21 bölüm, 2 meslek yüksekokulu ve 2 enstitüsü bulunmaktadır. 286 akademisyenin çalışmalarını yürüttüğü bu birimlerde 7068 öğrenci öğrenim görmektedir.', 'cankaya-universitesi', '32.5643239', '39.8192699', 'Ankara', null, '/m/08ngh6'), ('139', 'Doğuş Üniversitesi', 'Acıbadem, Kadıköy, 34722 İstanbul', 'http://www.patentvadisi.gov.tr/patentvadisi/uploads/105dogus_logo.jpg', 'http://www.dogus.edu.tr', 'Doğuş Üniversitesi, Doğuş Eğitim Vakfı tarafından 1997 yılında İstanbul\'da eğitim-öğretimde, araştırmada ve topluma hizmette mükemmele ulaşmış bir dünya üniversitesi olma amacıyla kurulmuş bir vakıf üniversitesidir. Kadıköy’de Acıbadem Mahallesi’nde bulunan yerleşkesinde ülkemizin bilim, teknoloji, sanat ve kültür alanındaki gelişmelerinde öncü rol üstlenme ve bu alanlarda insanlığın yararına çalışmalar yürütme misyonuyla eğitim veren Doğuş Üniversitesi bünyesinde 5 fakülte, 2 enstitü, 1 meslek yüksekokulu ve 1 sürekli eğitim merkezi bulunmaktadır. Bu birimlerde 182 akademisyen görev almakta, 5518 öğrenci de öğrenim görmektedir.', 'dogus-universitesi', '29.0471269', '41.0004024', 'İstanbul', null, '/m/02qgp_m'), ('140', 'Fatih Sultan Mehmet Vakıf Üniversitesi', 'Zeyrek Mah. Büyükkaraman Cad. No:53 Fatih /İSTANBUL', 'http://iro.fatihsultan.edu.tr/resimler/fsmvu-logo-en.png', 'http://www.fsm.edu.tr', 'Fatih Sultan Mehmet Üniversitesi Vakıf Üniversitesi, Fatih Sultan Mehmet Han Vakfı, Sinan Ağa bin Abdurrahman , Nurbanu Valide Sultan , Hatice Sultan ve Abdullahoğlu Hacı Abdülaziz Ağa Vakıflarının ortak çalışmasıyla 2010 yılında tarihin derinliklerinden bilimin ve sanatın ufuklarına sloganıyla İstanbul\'da vakıf üniversitesi statüsü ile kurulmuştur. Üniversite, rektörlüğün bulunduğu Fatih yerleşkesi ile birlikte Haliç, Topkapı, Kandilli, Küçük Çamlıca, Atik Valide Yerleşkelerinde konumlanan üniversite bünyesinde 6 fakülte, 5 enstitü ve 2 meslek yüksek okulu bulunmaktadır. Bu birimlerde 213 akademik personel çalışma yürütmektedir. 3815 öğrenci ise üniversitede öğrenim görmektedir.', 'fatih-sultan-mehmet-vakf-universitesi', null, null, 'İstanbul', null, '/g/113qbrdxg'), ('141', 'Gedik Üniversitesi', 'Cumhuriyet Mahallesi İlkbahar Sokak No: 1-3-5 Yakacık 34876 Kartal İstanbul', 'http://gedik.edu.tr/wp-content/uploads/uni-logo.jpg', 'http://www.gedik.edu.tr', '', 'gedik-universitesi', null, null, 'İstanbul', null, '/g/120khcv3'), ('142', 'Girne Amerikan Üniversitesi', '', 'http://www.gau.edu.tr/images/logo/gau_logo_dikey_beyaz.jpg', 'http://www.gau.edu.tr/', '', 'girne-amerikan-universitesi', null, null, 'Girne (KKTC)', null, '/m/025w_85'), ('143', 'Girne Üniversitesi', '', null, 'http://kyrenia.edu.tr/?lang=tr', '', 'girne-universitesi', null, null, 'Girne (KKTC)', null, '/m/0vplv89'), ('144', 'Haliç Üniversitesi', 'Merkez Mah. Cendere Cad. No:5 Kağıthane - İSTANBUL', 'http://logovector.org/wp-content/uploads/logos/png/h/halic_universitesi_logo.png', 'http://www.halic.edu.tr', 'T.C. Haliç Üniversitesi, Bizim Lösemili Çocuklar Vakfı tarafından 15.01.1998 tarihinde her alanda önemli gelişmeler kaydeden yeni Türkiye’nin hedeflerine katkı sağlayan, çoğulcu, özgürlükçü, katılımcı ve demokratik bir üniversite olma vizyonuyla kurulan bir vakıf üniversitesidir. Kağıthane Yerleşkesi üniversitenin merkez yerleşkesidir. Haliç Üniversitesi\'nin bunun dışında Şişhane, Bomonti, Levent ve Sütlüce yerleşkeleri bulunmaktadır. Üniversite 5 Fakülte, 3 Yüksekokul, 1 Konservatuvar, 1 Meslek Yüksekokulu ve 3 Enstitüsünde ön lisans, lisans, yüksek lisans ve doktora/sanatta yeterlik programları da dahil olmak üzere yaklaşık 10.000 öğrencisi ve 339 akademik personeli ile eğitim-öğretim faaliyetine devam etmektedir.', 'halic-universitesi', null, null, 'İstanbul', null, '/m/0g53jr4'), ('145', 'Hasan Kalyoncu Üniversitesi', 'Hasan Kalyoncu Üniversitesi Havaalanı Yolu Üzeri 8. km. - Şahinbey / GAZİANTEP', 'http://www.hku.edu.tr/images/ana_logo.png', 'http://www.hku.edu.tr', 'Hasan Kalyoncu Üniversitesi Gaziantep Eğitim ve Hizmet Vakfı tarafından 30 Temmuz 2008 tarihinde Gaziantep\'te vakıf üniversitesi olarak eğitimin hayat boyu seninle sloganı ile kurulmuştur. Üniversite\'nin 5 fakülte, 2 yüksekokul 1 meslek yüksekokulu, 3 enstitü ve 9 araştırma ve uygulama merkezinde 203 akademisyen çalışmalarını yürütmektedir. 4332 öğrenci ise bu birimlerde öğrenim görmektedir.', 'hasan-kalyoncu-universitesi', null, null, 'Gaziantep', null, null), ('146', 'İhsan Doğramacı Bilkent Üniversitesi', 'Bilkent Üniversitesi, 06800 Bilkent/Ankara/TÜRKİYE', 'http://w3.bilkent.edu.tr/www/wp-content/uploads/sites/5/2015/09/TR-amblem-yazi.svg', 'http://www.bilkent.edu.tr/', 'İhsan Doğramacı Bilkent Üniversitesi 1984’te Türkiye’nin ilk vakıf üniversitesi olarak Ankara’da kurulmuş,1986’da tüm bilimler, teknoloji ve sanatı kapsayan bir öğrenme ve ilerleme ortamı oluşturarak, insanlığa hizmet etmek ve dünya barışını geliştirme misyonuyla eğitime başlamıştır. Bilkent Üniversitesi\'nin yerleşkesi kent merkezine 12 km. mesafede ve 5.000 dönümlük bir alan üzerinde konumlanmıştır. 13.000 öğrencinin öğrenim gördüğü 9 fakültesi ve 2 yüksekokulu bünyesindeki 29 lisans ve 51 lisansüstü programında 1000 kadar akademik personel çalışmalarını yürütmektedir.', 'ihsan-dogramac-bilkent-universitesi', '32.748825', '39.8690764', 'Ankara', null, '/m/034l98'), ('147', 'Işık Üniversitesi', 'Işık Üniversitesi Büyükdere Caddesi No: 194 34398 Maslak/İstanbul', 'http://logovector.org/wp-content/uploads/logos/png/i/isik_universitesi_logo.png', 'http://www.isikun.edu.tr/', 'Işık Üniversitesi 1996 yılında köklü eğitim geleneği ile toplumsal sorumluluğa sahip, geleceği aydınlatan nesilleri yetiştiren, dünya standardında bir üniversite olma vizyonu ile İstanbul il sınırları içerisinde vakıf üniversitesi statüsünde kurulmuştur. Işık Üniversitesi\'nin Maslak ve Şile olmak üzere iki yerleşkesi mevcuttur. 5554 öğrencinin öğrenim gördüğü 5 fakülte 1 yabancı diller okulu, 2 meslek yüksekokulunda 233 akademik personel görev yapmaktadır.', 'isk-universitesi', null, null, 'İstanbul', null, '/m/02vxsj'), ('148', 'İstanbul 29 Mayıs Üniversitesi', 'İcadiye-Bağlarbaşı Caddesi, No: 40 34662 Üsküdar/İstanbul', 'https://www.29mayis.edu.tr/images/logo.svg', 'http://www.29mayis.edu.tr', 'İstanbul 29 Mayıs Üniversitesi, 2010 yılında Türkiye Diyanet Vakfı tarafından özgün araştırmalarla insanlığın bilimsel birikimine katkıda bulunmayı ve bunu sağlayabilmek için yetkin araştırmacı ve bilim insanları yetiştirme amacıyla kurulmuş bir vakıf üniversitesidir. Üsküdar da merkez kampüsü bulunan üniversitenin ikinci kampüsü Ümraniye ilçe sınırları içerisindedir. 872 öğrencinin öğrenim gördüğü 3 fakülte, 1 enstitü, 1 yüksekokul ve 4 araştırma merkezinde 29 Mayıs Üniversitesi, 105 personelin bulunduğu yetkin akademik kadrosuyla faaliyetlerini sürdürmektedir.', 'istanbul-29-mays-universitesi', '29.04076', '41.0257369', 'İstanbul', null, '/g/120vhgl9'), ('149', 'İstanbul Arel Üniversitesi', 'Türkoba Mahallesi Erguvan Sokak No:26 / K 34537, Tepekent - Büyükçekmece, İstanbul-Türkiye', 'http://www.arel.edu.tr/theme/arel/img/logo.png', 'http://www.arel.edu.tr', 'İstanbul Arel Üniversitesi, 18 Mayıs 2007 tarihinde Kemal Gözükara Eğitim ve Kültür Vakfı tarafından Atatürk İlke ve İnkılaplarına bağlı; laik, demokrat ve sosyal hukuk devleti olan Türkiye Cumhuriyeti’nin varlığına inanmış, ulusal değerlere sahip, bilimsel ve teknolojik gelişmelere açık, araştıran, küresel düşünebilen, evrensel değerlere saygılı gençler yetiştirme amacıyla vakıf üniversitesi statüsünde İstanbul\'da kurulmuştur. Arel Üniversitesi\'nin Tepekent ve Sefaköy\'de iki yerleşkesi bulunmaktadır. Üniversite bünyesinde Fen - Edebiyat, İktisadi ve İdari Bilimler, Güzel Sanatlar, Mühendislik - Mimarlık ve İletişim Fakültesi olmak üzere 5 fakülte, Uygulamalı Bilimler Yüksekokulu, Sağlık Bilimleri Yüksekokulu ve Yabancı Diller Yüksekokulu olmak üzere 3 yüksekokul, 1 meslek yüksekokulu ile Fen Bilimleri Enstitüsü ve Sosyal Bilimler Enstitüsü olmak üzere 2 enstitü bulunmakta bu birimlerde 12.600 öğrenci öğrenim görmekte, 427 akademik personel de çalışmalarını yürütmektedir.', 'istanbul-arel-universitesi', '28.5002626', '41.0555413', 'İstanbul', null, '/m/0r8mvy7'), ('150', 'İstanbul Aydın Üniversitesi', 'Beşyol Mah.Inönü Cad.No: 38, Sefaköy-Küçükçekmece / İSTANBUL', 'http://ue.aydin.edu.tr/img/Aydin.png', 'http://www.aydin.edu.tr', 'İstanbul Aydın Üniversitesi, Anadolu Eğitim ve Kültür Vakfı tarafından İstanbul\'da bilgiyi üretime dönüştürerek insanlığa fayda sağlayacak bireylerin, çağdaş değişimler doğrultusunda kendini yenileyebilen eğitim programlarında yetiştirildiği, sürdürülebilir yeniliklerin hayat bulduğu öncü bir yükseköğretim kurumu olma vizyonuyla 18.05.2007 tarihinde kurulmuş vakıf üniversitesidir. Merkez yerleşkesi Florya Yerleşkesi olan üniversite, Bahçelievler, Bahçelievler Diş Hekimliği, Kadıköy, Beşiktaş ve Bakırköy olmak üzere toplam 6 yerleşkede faaliyetlerini sürdürmektedir. 21.961 öğrencinin öğrenim gördüğü, 10 fakülte, 3 enstitü, 1 yüksekokul, 3 meslek yüksekokulu, ve 19 araştırma merkezinde 727 akademik personel ile 453 idari personel görev almaktadır.', 'istanbul-aydn-universitesi', '28.7980608', '40.9917087', 'İstanbul', null, '/m/0kg2tb3'), ('151', 'İstanbul Bilgi Üniversitesi', 'Hacıahmet Mahallesi, Pir Hüsamettin Sokak No:20, 34440 Beyoğlu İstanbul', 'http://www.kurumsalhaberler.com/images/ekler/1016/2010/4/istanbul-bilgi-universitesi.jpg', 'http://www.bilgi.edu.tr/', 'Bilgi Üniversitesi 7 Haziran 1996 tarihinde Bilgi Eğitim ve Kültür Vakfı tarafından bilimin ve sanatın sınırlarını genişleten, özgürlükçü, toplumsal gelişime önderlik eden, öğrencileri ile akademik kadrosunun birlikte öğrenme tutkusu etrafında buluştukları, bütün akademik ve idari bileşenlerinin bu arayışa kendilerini adadıkları uluslararası bir üniversite olma amacıyla İstanbul\'da vakıf üniversitesi statüsünde kurulmuştur. Üniversite\'nin Kuştepe, Dolapdere ve Santralistanbul olmak üzere üç yerleşkesi bulunmaktadır. 25.000 öğrencinin öğrenim gördüğü üniversitenin 6 fakülte, 5 enstitü, 5 yüksekokul ve 3 meslek yüksekokulunda 1.000 akademik personel görev almaktadır.', 'istanbul-bilgi-universitesi', null, null, 'İstanbul', null, '/m/0815rx'), ('152', 'İstanbul Bilim Üniversitesi', 'Gayrettepe, 34349 İstanbul, Türkiye', 'http://www.freelogovectors.net/wp-content/uploads/2012/06/istanbul-bilim-universitesi-logo.jpg', 'http://www.istanbulbilim.edu.tr', '', 'istanbul-bilim-universitesi', null, null, 'İstanbul', null, null), ('153', 'İstanbul Esenyurt Üniversitesi', 'Doğan Araslı Bulv. No:79 Esenyurt, İstanbul / Türkiye', null, 'http://www.esenyurt.edu.tr', 'İstanbul Esenyurt Üniversitesi, Yeşilköy 2001 Eğitim, Sağlık, Kültür Vakfı tarafından Özgürlükçü, akademik ve fiziki altyapısı ile öne çıkan, geleneklere ve farklılığa saygılı,Ülkesine ve bilime hizmeti amaç edinmiş, disiplinler arası ve dünya standartlarında bir eğitim anlayışı ile özgün bilgiler yaratılmasını sağlayan, geleceğe yön verebilecek bireyleri yetiştiren öncü bir dünya üniversitesi olma amacıyla İstanbul\'da vakıf üniversitesi statüsüyle kurulmuştur.180 akademik personelin çalışma yürüttüğü Üniversite bünyesinde 4 fakülte, 2 yüksekokulu, 2 meslek yüksekokulu 3 enstitü ve bu birimlerde de okuyan 3667 öğrenci bulunmaktadır.', 'istanbul-esenyurt-universitesi', null, null, 'İstanbul', null, '/g/1s067rlyt'), ('154', 'İstanbul Gelişim Üniversitesi', 'Cihangir mah. Şehit Jandarma Komando Er Hakan Öner Sk. No:1 Avcılar / İSTANBUL', null, 'http://www.gelisim.edu.tr', 'İstanbul Gelişim Üniversitesi, Gelişim Eğitim ve Kültür Vakfı tarafından 14.7.2008 tarihinde yüksekokul olarak kurulmuştur. 17.02.2011 tarihine gelindiğinde ise vakıf üniversitesi statüsünde eğitime başlamıştır. Üniversite Avcılar\'da bulunan Cihangir Mahallesi\'ndeki yerleşkesini merkez yerleşke olarak belirlemiştir. Üniversitenin Avcılar yan yol üzerinde bir meslek yüksekokulu yerleşkesi de bulunmaktadır. Üniversite, 3 fakültesi, 3 yüksekokulu, 2 meslek yüksekokulu ve 3 enstitüsünde yaklaşık 170 bölümle, 20 bin öğrenciye 394 akademik personeli ile eğitim vermektedir.', 'istanbul-gelisim-universitesi', null, null, 'İstanbul', null, '/g/1hb_dh4lr'), ('155', 'İstanbul Kemerburgaz Üniversitesi', 'Mahmutbey Dilmenler Caddesi,   No:26, 34217 Bağcılar - İSTANBUL', null, 'http://www.kemerburgaz.edu.tr', 'İstanbul Kemerburgaz Üniversitesi 2008 yılında, Mehmet Altınbaş Eğitim ve Kültür Vakfı tarafından kurulmuş İstanbul\'da bilim farkıyla önde sloganıyla vakıf üniversitesi olarak kurulmuştur. Üniversite ilk öğrencilerini 2011-2012 akademik yılında alarak eğitim-öğretim hayatına başlamıştır. Üniversitenin Şişli ve Mahmutbey olmak üzere 2 yerleşkesi bulunmaktadır. 3861 öğrencinin öğrenim gördüğü üniversitenin 8 fakülte, 3 enstitü ve 2 meslek yüksekokulunda 310 akademik personel görev yapmaktadır.', 'istanbul-kemerburgaz-universitesi', null, null, 'İstanbul', null, '/m/0pdny5h'), ('156', 'İstanbul Kültür Üniversitesi', 'E5 Karayolu üzeri Bakırköy 34156 İstanbul', null, 'http://www.iku.edu.tr', 'İstanbul Kültür Üniversitesi 15 Temmuz 1997 tarihinde Türkiye Cumhuriyeti Devleti’nin ve Türk milletinin \"çağdaş medeniyet seviyesini aşma\" yolunda değişmez hedefine ulaşması, gençlerin, hangi aşamada olursa olsun, nitelikli bir eğitim almaları ile ancak mümkün olduğundan hareketle kaliteli yükseköğretim yapma amacı ile İstanbul\'da vakıf üniversitesi statüsünde kurulmuştur. Kültür Üniversitesi\'nin Ataköy, Şirinevler ve İncirli olmak üzere 3 yerleşkesi bulunmaktadır. 10743 öğrencinin öğrenim gördüğü üniversitede bulunan 7 fakülte, 3 meslek yüksekokulu, 2 enstitü ve 10 araştırma merkezinde 611 akademik personel görev yapmaktadır.', 'istanbul-kultur-universitesi', null, null, 'İstanbul', null, '/m/0ch4_4d'), ('157', 'İstanbul Medipol Üniversitesi', 'Unkapanı, Atatürk Bulvarı No:27 34083 Fatih-İstanbul', null, 'http://www.medipol.edu.tr/', 'İstanbul Medipol Üniversitesi, Türkiye Eğitim Sağlık ve Araştırma Vakfı tarafından 7 Temmuz 2009 tarihinde İstanbul\'da güçlü kurumsal kültürü, girişimcilik ruhu ve sürekli gelişime açık dinamizmi ile bilime ve topluma yön veren öncü bir üniversite olma vizyonuyla vakıf üniversitesi olarak kurulmuştur. Üniversite rektörlüğün bulunduğu Haliç Yerleşkesi ve diğer yerleşkesi olan Kavacık Yerleşkesi\'nde konumlanmıştır. 4942 öğrencinin öğrenim gördüğü üniversitenin 11 Fakülte, 1 yüksekokul, 4 meslek yüksekokulu, 4 enstitü ve 7 araştırma ve uygulama merkezinde 683 akademik personel görev almaktadır.', 'istanbul-medipol-universitesi', null, null, 'İstanbul', null, '/g/1hb_fvc0h'), ('158', 'İstanbul Rumeli Üniversitesi', 'Yeni Mah. Mehmet Silivri Cad. No: 38 Silivri - İstanbul / TÜRKİYE', null, 'http://www.rumeli.edu.tr/', 'İstanbul Rumeli Üniversitesi, 3 Fakülte, 4 Meslek Yüksekokulu, 2 Enstitü ile İstanbul\'da, Silivri, Çatalca, Esenyurt ve Maltepe yerleşkelerinde faaliyet göstermektedir. 2016-2017 eğitim öğretim yılında ilk öğrencilerini karşılayacak olan üniversite, çağdaş eğitim programları ve mezunlarının kalitesiyle fark yaratacak öncü üniversite olmayı vizyon edinmiştir. Ayrıca, yaşam boyu eğitim felsefesiyle insan gücü kalitesinin yükseltilmesine katkı sağlamak üniversite değerlerindendir.', 'istanbul-rumeli-universitesi', null, null, 'İstanbul', null, null), ('159', 'İstanbul Sabahattin Zaim Üniversitesi', 'İstanbul Sabahattin Zaim Üniversitesi, Halkalı Cad. No:2 Halkalı - Küçükçekmece / İSTANBUL', null, 'http://www.izu.edu.tr', 'İstanbul Sabahattin Zaim Üniversitesi , 2010 yılında İstanbul\'da İlim Yayma Vakfı tarafından akademik ve fiziki alt yapısı ile öne çıkan, mezunları tercih edilen, yayınları başvuru kaynağı olan ve üniversitelerimiz arasında ilk yedide yer alan bir araştırma üniversitesi olma amacıyla kurulan bir vakıf üniversitesidir. Merkez kampüsü Halkalı\'da bulunan İzü\'nün Eyüp\'te de yerleşkesi bulunmaktadır. 2517 öğrencinin öğrenim gördüğü üniversitenin 8 fakülte ve 2 enstitüsünde 163 akademisyen görev almaktadır.', 'istanbul-sabahattin-zaim-universitesi', '28.7883359', '41.0336113', 'İstanbul', null, '/m/0zdnj1v'), ('160', 'İstanbul Şehir Üniversitesi', 'Kuşbakışı Caddesi No: 27 34662, Altunizade – Üsküdar – İstanbul', null, 'http://www.sehir.edu.tr', 'İstanbul Şehir Üniversitesi, 1986 yılından bu yana Bilim ve Sanat Vakfı’na yön veren akademik arayışın içinden doğdu. Gerçek bir “vakıf üniversitesi” olarak yola çıkan İstanbul Şehir Üniversitesi, fiilî kuruluş çalışmalarına 2007 yılında başladı.Keşifsel bilginin üretimine ve yaygınlaştırılmasına katkıda bulunmayı amaçlayan İstanbul Şehir Üniversitesi, özgün, katılımcı, evrensel ve özgürlükçü perspektifiyle ve zenginleşen ekibiyle, 2010-2011 akademik yılında ilk öğrencileri ile buluştu. İstanbul Şehir Üniversitesi, Halen 6 fakülte, 3 enstitü çatısı altında 14 lisans, 15 lisansüstü programı ile Altunizade Doğu, Altunizade Batı ve Altunizade Güney Kampüsleri\'nde 188 akademik personeli ve 3393 öğrencisiyle faaliyetlerini sürdürüyor.İstanbul Şehir Üniversitesi misyonu; iyi, doğru ve güzeli aramak, insan, toplum ve doğayı anlamak, bu arayışın ürünü olan bilgileri tüm insanlıkla paylaşmaktır.', 'istanbul-sehir-universitesi', null, null, 'İstanbul', null, '/m/0dllgdd'), ('161', 'İstanbul Ticaret Üniversitesi', 'Küçükyalı E5 Kavşağı İnönü Cad. No: 4, Küçükyalı 34840, İstanbul', null, 'http://www.ticaret.edu.tr', 'İstanbul Ticaret Üniversitesi, İstanbul Ticaret Odası Eğitim ve Sosyal Hizmetler Vakfı tarafından 2001 yılında akademik esnekliğini yitirmeden, bilgi çağının gerekliliği olan disiplinler arası çalışmaları bünyesinde yürütebilen; uluslararası bilimsel faaliyetlerde aktif ve belirleyici olarak yer alan, adını aldığı İstanbul’a yaraşır, yalnız ulusal düzeyde değil uluslararası düzeyde de saygınlığı kabul edilmiş, önde gelen akademik kurumların içinde yer alma vizyonuyla İstanbul\'da kurulmuştur. Üniversite\'nin yerleşkeleri Eminönü, Sütlüce, Küçükyalı ve Bursa\'da konumlanmıştır. 7.000 öğrencinin öğrenim gördüğü 6 fakülte (Fen Edebiyat, Ticari Bilimler, Hukuk, İletişim, Mühendislik ve Tasarım ile Uygulamalı Bilimler), İngilizce Hazırlık Bölümü ve 4 enstitü (Dış Ticaret, Sosyal Bilimler, Fen Bilimleri ve Finans Enstitüsü) ile araştırma ve uygulama merkezlerinde 300’ü aşkın akademisyen görev almaktadır.', 'istanbul-ticaret-universitesi', null, null, 'İstanbul', null, '/m/05b4f29'), ('162', 'İstinye Üniversitesi', 'Maltepe Mahallesi Edirne Çırpıcı Yolu No.9 Cevizlibağ / Topkapı / İstanbul / TÜRKİYE', null, 'http://www.istinye.edu.tr/', 'İstinye Üniversitesi, Türkiye’nin en büyük sağlık markası olan MLPCare Grubu’nun eğitime değerli bir yatırımıdır. Türkiye\'nin dört bir yanında 27 hastane ve 14 bin çalışanıyla hizmet veren bir sağlık grubu olarak 20 yılı aşkın sürede kazandığı bilgi ve birikimi, siz gençlerimizin eğitim ve öğretimi için kullanacaktır. İstinye Üniversitesi, bu yıl Tıp Fakültesi, Sağlık Bilimleri Fakültesi ve Sağlık Hizmetleri Meslek Yüksekokulu’yla eğitime başlayacak olup tüm öğrencilerine belli oranlarda burs verecektir. Ayrıca bütün öğrencilerini sağlık sigortasıyla güvenceye alacaktır.', 'istinye-universitesi', null, null, 'İstanbul', null, null), ('163', 'İzmir Ekonomi Üniversitesi', 'İzmir Ekonomi Üniversitesi, Sakarya Caddesi, No:156, 35330 Balçova - İzmir / TÜRKİYE', null, 'http://www.ieu.edu.tr', 'İzmir Ekonomi Üniversitesi 14 Nisan 2001 tarihinde, evrensel düzeyde kaliteli eğitim-öğretim ve bilimsel araştırmalarla topluma öncülük eden seçkin bir yüksek öğretim kurumu amacıyla İzmir’de bölgenin ilk vakıf üniversitesi olarak kurulmuştur. Üniversite\'nin tek kampüsü Balçova Kampüsü\'dür. Üniversite bünyesinde bulunan 8 fakülte, 2 yüksekokul, 3 meslek yüksekokulu, 3 enstitü, 9 uygulama ve araştırma merkezinde 7605 öğrenci öğrenim görmektedir.', 'izmir-ekonomi-universitesi', '27.044704', '38.3877014', 'İzmir', null, '/m/08w6yd'), ('164', 'Kadir Has Üniversitesi', 'Kadir Has Caddesi, Cibali / İSTANBUL 34083', null, 'http://www.khas.edu.tr', 'Kadir Has Vakfı (HASVAK) tarafından 28.05.1997 tarihinde İstanbul\'da Dünya\'nın ileri gelen üniversitelerine koşut bir eğitim, araştırma ve tartışma ortamı sağlama ve öğrencilerinin disiplinler arası donanım ile yetiştirilmeleri, geleceğe hazırlanırken sosyal ve kültürel alanlarda gelişimlerini sürekli kılmaları, doğruyu ararken çok yönlü değerlendirme yapmayı öğrenmeleri amacıyla vakıf üniversitesi statüsünde kurulmuştur. Üniversite merkez kampüsü olan Kadir Has Kampüsü (Cibali) dışında Bahçelievler ve Selimpaşa Kampüsleri\'nde konumlanmıştır. 6130 öğrencinin öğrenim gördüğü üniversite bünyesinde bulunan 6 fakülte, 9 araştırma merkezi, 3 enstitü, 2 meslek yüksekokulu, 1 yüksekokul ve 1 yaşam boyu eğitim merkezinde 246 akademik personel çalışmalarını yürütmektedir.', 'kadir-has-universitesi', '28.958712', '41.025105', 'İstanbul', null, '/m/026kpcz'), ('165', 'Kıbrıs Amerikan Üniversitesi', '', null, 'http://www.auc.edu.tr/', '', 'kbrs-amerikan-universitesi', null, null, 'Lefkoşa (KKTC)', null, null), ('166', 'Kıbrıs Sosyal Bilimler Üniversitesi', '', null, 'http://www.kisbu.edu.tr/', '', 'kbrs-sosyal-bilimler-universitesi', null, null, 'Lefkoşa (KKTC)', null, null), ('167', 'Koç Üniversitesi', 'Rumelifeneri Yolu 34450 Sarıyer, İstanbul / Türkiye', null, 'http://www.ku.edu.tr', 'Koç Üniversitesi 1993 yılında Türkiye\'de uluslararası nitelikte, yaratıcı, bağımsız ve objektif düşünebilen, liderlik vasıflarına sahip en yetkin mezunları yetiştirmek; bilimin sınırlarını ilerletme ve örnek bir öğretim ve araştırma kurumu olarak Türkiye ve insanlığa hizmet etme misyonuyla İstanbul\'da eğitime başlamış olan bir vakıf üniversitesidir. Koç Üniversitesi\'nin ana kampüsü Rumelifeneri, Sarıyer’dedir. Üniversite’nin ayrıca Zekeriyaköy’de Batı Kampüsü, İstinye’de İstinye Kampüsü, Beyoğlu\'nda ANAMED ve Nişantaşı’nda Hemşirelik Yüksekokulu bulunmaktadır. 5347 öğrencinin öğrenim gördüğü üniversitenin 6 fakülte, 1 yüksekokul, 4 enstitü, 3 araştırma forumu, 17 araştırma merkezinde 486 akademik personel bulunmaktadır.', 'koc-universitesi', '29.0723753', '41.2053007', 'İstanbul', null, '/m/06ydzx'), ('168', 'Konya Gıda Ve Tarım Üniversitesi', 'Dede Korkut Mah. Beyşehir Cad. No:9 42080 Meram / KONYA', null, 'http://www.gidatarim.edu.tr/', 'Torku markasının yaratıcısı Anadolu Birlik Holding ve Konya Şeker A.Ş. desteği ile Bilimsel Araştırma, Teknoloji, Eğitim ve Kültür Vakfı tarafından 2013 yılında kurulan Konya Gıda ve Tarım Üniversitesi, bünyesindeki 3 fakülte ve 2 enstitü ile lisans ve yüksek lisans seviyesinde İngilizce eğitim vermektedir. Konya Gıda ve Tarım Üniversitesi, üniversite giriş sınavı sonrasında bölümlere yerleşmek yerine, öğrencilerin fakülteler altında bulunan programlara yerleşmesine olanak sağlayarak, ortak ders programı süresi sonunda, aynı program altında yer alan bölümlerden öğrencilerin istediğini seçebileceği Türkiye’deki üç üniversiteden bir tanesidir. Akademik derecelerini Türkiye’nin ve Dünya’nın seçkin üniversitelerinden almış akademik kadrosu ile Konya Gıda ve Tarım Üniversitesi, öğrencilerine daha henüz öğrenciyken ulusal ve uluslararası Ar-Ge projelerinde görev alma şansı vermektedir. Üniversitenin uygulama odaklı eğitim programı sayesinde öğrencilerin henüz mezun olmadan alanlarında ciddi bir tecrübeye sahip olmasını sağlanacaktır. Türkiye’nin en kapsamlı burs paketlerinden birine sahip olan Konya Gıda ve Tarım Üniversitesi’ne bu yıl yerleşecek tüm öğrenciler eğitimlerini tam burslu olarak görecekler ve mezuniyetleri sonrasında, Anadolu Birlik Holding çatısı altında yer alan şirketlerin faaliyet gösterdikleri alanlar olan gıda, enerji, bilişim, biyoteknoloji, kimya, tarım, tohumculuk, hayvancılık, pazarlama, dış ticaret, lojistik, tedarik zinciri yönetimi ve benzer alanlarda işe yerleştirme garantisine sahip olacaklardır. Konya Gıda ve Tarım Üniversitesi’nde bu yıl eğitim ve öğretime başlayacak fakülte ve bölümlerimiz şu şekildedir. Mühendislik ve Mimarlık Fakültesi altında Bilgisayar Mühendisliği, Biyomühendislik ve Gıda Mühendisliği bölümleri olacaktır. Tarım ve Doğa Bilimleri Fakültesi altında Bitkisel Üretim ve Teknolojileri, Moleküler Biyoloji ve Genetik bölümleri yer alacaktır. Sosyal ve Beşeri Bilimler Fakültesi altında Ekonomi ve Uluslararası Ticaret ve İşletmecilik bölümleri yer alacaktır.', 'konya-gda-ve-tarm-universitesi', null, null, 'Konya', null, null), ('169', 'Kto Karatay Üniversitesi', 'Akabe Mah. Alaaddin Kap Cad. No:130 42020 Karatay – Konya', null, 'http://www.karatay.edu.tr', 'Konya Ticaret Odası Karatay Üniversitesi, Konya Ticaret Odası’nın Eğitim ve Sağlık Vakfı tarafından 7 Temmuz 2009 yılında Konya\'da çağdaş eğitim sistemi, yaşamla iç içe yenilikçi yapısı, uygulamalı eğitimi, en az iki dil bilen, nitelikli, piyasayı tanıyan ve iş bulma kaygısı olmayan mezunlar veren, sektör odaklı eğitim programları ile özgün, yaratıcı ve kullanılabilir bilgi üreterek, toplumsal gelişime katkı sağlama amacıyla kurulmuştur. Karatay\'da bulunan kampüsünde eğitim veren üniversite bünyesinde 2824 öğrencinin öğrenim gördüğü 6 fakülte, 1 yüksekokul, 1 meslek yüksekokulu, 3 enstitü, 1 araştırma ve uygulama merkezinde 178 akademik personel görev yapmaktadır.', 'kto-karatay-universitesi', '32.537748', '37.864435', 'Konya', null, '/g/120rsh5z'), ('170', 'Lefke Avrupa Üniversitesi', '', null, 'http://www.eul.edu.tr/', '', 'lefke-avrupa-universitesi', null, null, 'Lefke (KKTC)', null, '/m/0cp3q23'), ('171', 'Lefkoşa İngiliz Üniversitesi', '', null, 'http://www.bun.edu.tr/', '', 'lefkosa-ingiliz-universitesi', null, null, 'Lefkoşa (KKTC)', null, '/g/1q677qtk2'), ('172', 'Maltepe Üniversitesi', 'Marmara Eğitim Köyü 34857 Maltepe/İSTANBUL.', null, 'http://www.maltepe.edu.tr/', 'Maltepe Üniversitesi “Düşüncede Özgür, Eğitimde Çağdaş, Bilimde Evrensel’ anlayışıyla 1997 yılında İstanbul Maltepe\'de İstanbul Marmara Eğitim Vakfı tarafından vakıf üniversitesi statüsü ile kurulmuştur. Maltepe Üniversitesi, Marmara Eğitim Köyü’nde bulunan 3 enstitü, 9 fakülte, 2 yüksekokul, 1 meslek yüksekokulu 15 merkez ve UNESCO kürsüsü ile 472 akademik personel 9159 öğrenciye eğitim vermektedir.', 'maltepe-universitesi', '29.1332155', '40.9206835', 'İstanbul', null, '/m/07vt91'), ('173', 'Mef Üniversitesi', 'Ayazağa Cad. No.4 34396 Maslak - Sarıyer - İstanbul', null, 'http://www.mef.edu.tr', 'Mef Üniversitesi Gelecek 100 yılı şekillendirecek, yenilikçi ve girişimci global liderler yetiştirme amacıyla 2014-2015 yılında İstanbul’da eğitim ve öğretime başlamıştır. Maslak Kampüsü’nde eğitim öğretime devam eden 608 öğrencinin öğrenim gördüğü üniversitenin bünyesinde eğitim fakültesi, hukuk fakültesi, iktisadi idari ve sosyal bilimler fakültesi, mühendislik fakültesi, sanat tasarım ve mimarlık fakültesi ve 1 meslek yüksekokulu bulunmaktadır. flipped classroom sistemi ile eğitim veren üniversite öğrencilerine 3+2 lisans+ uluslararası yüksek lisans, 3+1 lisans+tezsiz yüksek lisans ve tamamı yabancı okutmandan oluşan hazırlık programı sunmaktadır. Mef Üniversitesi\'nde 124 akademik personel çalışmalarını yürütmektedir.', 'mef-universitesi', null, null, 'İstanbul', null, '/m/010hmv83'), ('174', 'Nişantaşı Üniversitesi', 'Sadabad Kampüsü, Hasbahçe Cad. No.88, 34406 Kağıthane / İstanbul', null, 'http://www.nisantasi.edu.tr', '', 'nisantas-universitesi', null, null, 'İstanbul', null, '/m/0xp31dv'), ('175', 'Nuh Naci Yazgan Üniversitesi', 'Kuzey Çevreyolu Erkilet Dere Mah. Nuh Naci Yazgan Üniversitesi Yerleşkesi Kocasinan/KAYSERİ', null, 'http://www.nny.edu.tr', 'Nuh Naci Yazgan Üniversitesi Kayseri Yükseköğrenim ve Yardım Vakfı tarafından 23.06.2009 tarihinde Dünya standartlarında eğitim-öğretim ve bilimsel araştırma faaliyetleri yürüten; bilgi toplumunun oluşumuna katkı sağlayan; ülkemizin bilim, teknoloji, ve sanat alanında çağdaş uygarlık seviyesinin üzerine çıkmasına öncülük eden; akademik temeli sağlam olan; üniversite-sanayi iş birliğini en etkin bir şekilde gerçekleştiren; ulusal ve uluslararası düzeyde saygın ve lider bir üniversite olma vizyonu ile Kayseri\'de kurulan bir vakıf üniversitesidir. Üniversite Kocasinan\'da bulunan Nuh Naci Yazgan Üniversitesi Yerleşkesi\'nde konumlanmıştır. 1362 öğrencinin öğrenim gördüğü üniversitenin 6 fakülte, 2 enstitü ve 1 meslek yüksekokulunda 54 akademik personel akademik çalışma yürütmektedir.', 'nuh-naci-yazgan-universitesi', null, null, 'Kayseri', null, '/g/1234brnq'), ('176', 'Odlar Yurdu Üniversitesi', '', null, 'http://www.oyu.edu.az/', '', 'odlar-yurdu-universitesi', null, null, 'Bakü (Azerbaycan)', null, null), ('177', 'Okan Üniversitesi', 'Okan Üniversitesi Tuzla Kampüsü, 34959 Akfırat-Tuzla / İSTANBUL', null, 'http://www.okan.edu.tr', 'Türkiye\'nin en dinamik üniversitelerinden Okan Üniversitesi, Okan Kültür, Eğitim ve Spor Vakfı tarafından resmi 1999 yılında vakıf üniversitesi statüsünde kurulmuş, 2003-2004 Akademik Yılı\'nda ise başlamıştır. Kısa zamanda hızla büyüyen üniversite, 2006-2007 Akademik Yılı\'ndan itibaren yeni ve modern Tuzla Kampüsü\'ne yerleşmiştir. Okan Üniversitesi, 2012-2013 Akademik Yılı\'na 8 Fakülte, 2 Yüksekokul, 2 Meslek Yüksekokulu ve 3 Enstitüde 100\'ü aşkın bölüm ve 18 bini aşkın öğrencisiyle devam etmektedir.', 'okan-universitesi', '29.3541239', '40.9569569', 'İstanbul', null, '/m/03m6dyx'), ('178', 'Özyeğin Üniversitesi', 'Özyeğin Üniversitesi Çekmeköy Kampüsü, Nişantepe Mah. Orman Sok. 34794 Çekmeköy - İSTANBUL', null, 'http://www.ozyegin.edu.tr/Anasayfa', 'Özyeğin Üniversitesi Hüsnü M. Özyeğin Vakfı tarafından 2005 18 Mayıs 2007 tarihinde vakıf üniversitesi statüsü ile İstanbul\'da kurulmuştur. Maddi yönden erişilebilir ve girişimci bir araştırma üniversitesi olduğunu beyan eden Özyeğin Üniversitesi, bütün programlarında Türkiye, Doğu Avrupa ve Orta Doğu’nun en iyi on üniversitesinden biri ve dünyanın en iyi ilk iki yüz üniversitesinden biri olarak hem ulusal hem de uluslararası arenada kabul görmeyi hedeflemektedir. Çekmeköy Kampüsü\'nde faaliyetlerini yürüten 5395 öğrencinin öğrenim gördüğü üniversitenin bünyesinde 5 fakülte, 3 enstitü, 3 yüksekokul bulunmaktadır. Bu birimlerde 305 akademik personel görev almaktadır.', 'ozyegin-universitesi', '28.8988719', '41.0089039', 'İstanbul', null, '/m/03m62zw'), ('179', 'Piri Reis Üniversitesi', 'Postane Mahallesi, Eflatun Sk. No:8, 34940 Tuzla/İSTANBUL', null, 'http://www.pirireis.edu.tr', '', 'piri-reis-universitesi', null, null, 'İstanbul', null, '/m/0drx0zh'), ('180', 'Sabancı Üniversitesi', 'Sabancı Üniversitesi, Orta Mahalle, Üniversite Caddesi No:27 Tuzla, 34956 İstanbul', null, 'http://www.sabanciuniv.edu', '1999 yılında katılımcı farklılığa saygılı, özgürlükçü bir kurum kültürü içinde, tüm paydaşlarımızın gereksinimlerine duyarlı, yenilikçi, disiplinler arası bir eğitim altyapısı ile, öncülüğe yol açan özgün bilginin yaratılmasını ve yayılmasını sağlayan, araştırma ve eğitim alanındaki yaratıcılığı ile uluslararası bir referans noktası olma vizyonuyla İstanbul’da eğitime başlayan Sabancı Üniversitesi, Mühendislik ve Doğa Bilimleri, Sanat ve Sosyal Bilimler ve Yönetim Bilimleri Fakülteleri altında 13 lisans ve 54 lisansüstü programıyla eğitim veren Türkiye\'nin ilk bölümsüz vakıf üniversitesidir. Tuzla Kampüsü\'nün merkez yerleşke olduğu üniversitede 4097 öğrenci öğrenim görmekte 388 akademik personel de görev almaktadır. Sabancı Üniversitesi Times Higher Education\'ın \"Dünya 50 Yaşın Altındaki En İyi 100 Üniversite-2015\" listesinde Türkiye\'de 1., dünyada 13. olmuştur. Bilim Sanayi ve Teknoloji Bakanlığı\'nın açıkladığı \"Girişimci ve Yenilikçi Üniversite Endeksi 2015\" sıralamasında da 1. seçilmiştir. İstanbul Politikalar Merkezi, Sakıp Sabancı Müzesi ve Nanoteknoloji Araştırma ve Uygulama Merkezi (SUNUM) Sabancı Üniversitesi bünyesinde bulunmaktadır. ***Sabancı Üniversitesi\'nde bölüm yapılanması olmadığı için programlar fakülte adı altında verilmiştir.', 'sabanc-universitesi', null, null, 'İstanbul', null, '/m/03400z'), ('181', 'Sanko Üniversitesi', 'İncilipınar Mah. Gazi Muhtar Paşa Bulv. No:36 27090 Şehitkamil/ GAZİANTEP  ', null, 'http://www.sanko.edu.tr', '', 'sanko-universitesi', null, null, 'Gaziantep', null, '/g/1q5bpz880');
INSERT INTO `university` VALUES ('182', 'Saraybosna Bilim Ve Teknoloji Üniversitesi', '', null, 'http://www.ssst.edu.ba/', '', 'saraybosna-bilim-ve-teknoloji-universitesi', null, null, 'Saraybosna (Bosna-Hersek)', null, null), ('183', 'Ted Üniversitesi', 'TED Üniversitesi, Ziya Gökalp Caddesi No.48, 06420, Kolej Çankaya, ANKARA', null, 'http://www.tedu.edu.tr', 'TED Üniversitesi 7.07.2009 tarihinde Türk Eğitim Derneği Yükseköğrenim Vakfı tarafından Ankara\'da küresel bilgi ekonomisinin gerektirdiği genişlik-derinlik dengesine sahip diploma programları ve yenilikçi öğretim yöntemleri ile çok yönlü, eleştirel düşünebilen, yaratıcı, girişimci, özgüveni yüksek ve hayat boyu öğrenmeyi ilke edinmiş bireylerin yetişmesini sağlamak; kurumsal öncelikli alanlarda araştırma ve yaratıcı çabalarla bilime evrensel katkı yapmak, şeffaf ve kurumsal yapısı ile tüm paydaşlarına hesap ve güven vermeyi ilke edinmiş, sürekliliği ve sürdürülebilir gelişmeyi hedefleyen, öğrenmeye açık bir üniversite olmayı misyon edinerek kurulmuş bir vakıf üniversitesidir. 1002 öğrencinin öğrenim gördüğü Çankaya ilçesindeki yerleşkesinde faaliyet gösteren üniversitenin 4 fakülte, 3 yüksek lisans programı ve temel bilimler biriminde 109 akademik personel akademik faaliyetlerini sürdürmeye devam etmektedir.', 'ted-universitesi', null, null, 'Ankara', null, '/g/1224zqh1'), ('184', 'Tobb Ekonomi Ve Teknoloji Üniversitesi', 'Söğütözü Caddesi No:43, Söğütözü, Ankara, 06560 Türkiye', null, 'http://www.etu.edu.tr', '', 'tobb-ekonomi-ve-teknoloji-universitesi', '32.7983511', '39.921788', 'Ankara', null, '/m/02rjdkp'), ('185', 'Toros Üniversitesi', 'Bahçelievler Kampüsü , 1857 Sokak, No 12, Yenişehir 33140, Mersin', null, 'http://www.toros.edu.tr', '', 'toros-universitesi', '34.5957219', '36.7918839', 'Mersin', null, '/m/0cpdrtt'), ('186', 'Türk Hava Kurumu Üniversitesi', 'Türk Hava Kurumu Üniversitesi, Bahçekapı Mahallesi Okul Sokak No:11 06790 Etimesgut/ANKARA', null, 'http://www.thk.edu.tr', 'Türk Hava Kurumu Üniversitesi 3 Mart 2011 tarihinde Türkiye\'nin ilk havacılık ve uzay bilimleri üniversitesi olarak Ankara\'da kurulmuştur. Merkez yerleşkesinin Ankara\'da bulunduğu bunun dışında 4 yerleşkeye daha sahip üniversitenin Eskişehir ve İzmir\'de de yerleşkeleri olmak üzere 4 yerleşkesi bulunmaktadır. Vakıf statüsünde olan THK Üniversitesi\'nin 5 fakülte, 2 enstitü 2 meslek yüksekokulu ve iki araştırma merkezi bulunmaktadır.', 'turk-hava-kurumu-universitesi', null, null, 'Ankara', null, '/g/1232c87b'), ('187', 'Ufuk Üniversitesi', 'Mevlana Bulvarı (Konya Yolu) No:86-88, 06520 Balgat - ANKARA', null, 'http://www.ufuk.edu.tr', 'Ufuk Üniversitesi 18 Aralık 1999 tarihinde Ankara\'da Türkiye Trafik Kazaları Yardım Vakfı tarafından trafik, iş spor ve diğer kazaların, afet ve felaketlerin önlenmesi ve bunların sonucu meydana gelen yaralanma ve hastalıklar için acil, tıbbi ve sosyal yardımın, rehabilitasyon hizmetleri yapılması ve bu konularda iş birliği yapmak üzere yükseköğretim kurumları dahil okullar açarak ihtiyaç duyulan her türlü elemanın yetiştirilmesi, lüzumlu araç ve gereçlerin sağlanması, bunlara ilişkin eğitim, kurs ve seminerlerle diğer bilimsel faaliyetlerin yapılması için ilgili kuruluşlar ile iş birliği yapmayı misyon edinerek “Geleceğinizin Başladığı Yer” sloganı ile kurulan bir vakıf üniversitesidir. Üniversite Balgat (merkez) ve İncek olmak üzere iki yerleşkede konumlanmıştır. Üniversitenin eğitim öğretim faaliyetlerini sürdürdüğü 5 fakülte 1 yüksekokul, 3 meslek yüksekokulu ve 2 sosyal bilimler enstitüsünde 3280 öğrenci öğrenim görmekte, 271 akademik personel de bu birimlerde görev almaktadır.', 'ufuk-universitesi', null, null, 'Ankara', null, '/m/09ykb8'), ('188', 'Uluslararası Antalya Üniversitesi', 'Üniversite Caddesi No:2 Döşemealtı/Antalya', null, 'http://www.antalya.edu.tr/', '', 'uluslararas-antalya-universitesi', null, null, 'Antalya', null, '/g/120v5p_s'), ('189', 'Uluslararası Balkan Üniversitesi', '', null, 'http://ibu.edu.mk/', '', 'uluslararas-balkan-universitesi', null, null, 'Üsküp (Makedonya)', null, null), ('190', 'Uluslararası Kıbrıs Üniversitesi', '', null, 'http://www.ciu.edu.tr/', '', 'uluslararas-kbrs-universitesi', null, null, 'Lefkoşa (KKTC)', null, '/m/03nx8rf'), ('191', 'Uluslararası Saraybosna Üniversitesi', '', null, 'http://www.ius.edu.ba/tr', '', 'uluslararas-saraybosna-universitesi', null, null, 'Saraybosna (Bosna-Hersek)', null, '/m/04lj7lt'), ('192', 'Üsküdar Üniversitesi', 'Altunizade Mh. Haluk Türksoy Sk. No:14 PK:34662 Üsküdar / İstanbul / Türkiye', null, 'http://www.uskudar.edu.tr', 'Üsküdar Üniversitesi, İnsani Değerler ve Ruh Sağlığı Vakfı tarafından 3 Mart 2011 tarihinde Çağdaş insan ve insan odaklı teknolojiye hâkim, yüksek nitelikli eğitim, öğretim, araştırma ve uygulama programları geliştirmek. Bölgesel kalkınmaya katma değer ve katılım sağlayan öncü, örnek bir evrensel üniversite olma ve Türkiye\'de, Avrupa Birliği ve dünya standartlarında eğitim ve öğretim yapma vizyonuyla İstanbul\'da kurulmuş bir vakıf üniversitesidir. Merkez, Güney ve Çarşı Yerleşkeleri\'nde öğretim yapan 6.275 öğrencinin öğrenim gördüğü üniversite bünyesinde 4 fakülte, 1 yüksekokul, 4 enstitü faaliyette bulunmaktadır. Bu birimlerde 239 akademik personel görev almaktadır.', 'uskudar-universitesi', null, null, 'İstanbul', null, '/g/15dqchld'), ('193', 'Yakın Doğu Üniversitesi', '', null, 'http://www.neu.edu.tr/', '', 'yakn-dogu-universitesi', null, null, 'Lefkoşa (KKTC)', null, '/m/0dh1vk'), ('194', 'Yaşar Üniversitesi', 'Üniversite Caddesi, No:37-39, Ağaçlı Yol, Bornova, İzmir PK. 35100', null, 'http://www.yasar.edu.tr', 'Yaşar Üniversitesi Yaşar Eğitim ve Kültür Vakfı tarafından 2001 yılında teknoloji ve bilimi entegre eden, fen ağırlıklı, dünyaya açılmış bir üniversite olma vizyonuyla vakıf üniversitesi statüsüyle İzmir’de kuruldu. Üniversite Bornova’da bulunan Selçuk Yaşar Kampüsü ve kampüsün yanına inşa edilen 8 bin 400 metrekarelik ek kampüs alanında eğitim öğretim faaliyetlerini sürdürmektedir. Eğitim dilinin İngilizce olduğu üniversite bünyesinde 7525 öğrencinin öğrenim gördüğü 7 fakülte, 25 bölüm, 1 meslek yüksekokulu ve adalet meslek yüksekokulu, fen bilimleri enstitüsü ve sosyal bilimler enstitüleri bulunmaktadır. Bu birimlerde 407 akademik personel akademik çalışmalarını sürdürmektedir.', 'yasar-universitesi', '27.202611', '38.454113', 'İzmir', null, '/m/0cpdqnn'), ('195', 'Yeditepe Üniversitesi', 'İnönü Mah. Kayışdağı Cad. 26 Ağustos Yerleşimi, 34755 Ataşehir - İstanbul', null, 'http://www.yeditepe.edu.tr/', '', 'yeditepe-universitesi', '29.1523468', '40.9727758', 'İstanbul', null, '/m/08ql5'), ('196', 'Yeni Yüzyıl Üniversitesi', 'Yeni Doğan Mahallesi Yılanlı Ayazma Caddesi, No: 26 P.K. 34010', null, 'http://www.yeniyuzyil.edu.tr', '', 'yeni-yuzyl-universitesi', null, null, 'İstanbul', null, '/g/120l36lx'), ('197', 'Yüksek İhtisas Üniversitesi', 'Oğuzlar Mah. 1377 Sok. No:21 Balgat/ Ankara ', null, 'http://www.yiu.edu.tr', '', 'yuksek-ihtisas-universitesi', null, null, 'Ankara', null, null);
